INSERT INTO `weibo` VALUES (1, '佳佳wk0Y', '2016-10-22 10:26:00', '//<a href=\"http://weibo.com/n/%E9%AB%98%E4%BC%9A%E6%B0%91?from=feed&amp;loc=at\">@高会民</a>: 转发微博', NULL, 0, '我的脑壳长了个包', '2016-10-22 09:04:00', '“对不起阿姨，我不能给你让座。。”——你遇到过道德绑架吗？ 卧槽，看一次爽一次！！！<a href=\"http://t.cn/RVpvjaT\"><i >L</i>我的脑壳长了个包的秒拍视频</a>', '<img src=\"http://qncdn.miaopai.com/imgs/QhK9Z19o0UEtRi8K1Fs7RQ___000002.jpg\"><i ></i><a>小窗口</a>');
