INSERT INTO `weibo` VALUES (12, '佳佳wk0Y', '2016-10-06 13:14:00', '//<a href=\"http://weibo.com/n/%E5%BB%96%E5%90%9B_Jun?from=feed&amp;loc=at\">@廖君_Jun</a>: 转发微博', NULL, 0, '张友平医生', '2016-10-05 14:24:00', '我给你看病，你的病恢复的快，你认为是理所当然的；你的病恢复的慢，你认为我是庸医，是刻意留你在医院里，好多赚点钱。给你治好了，你认为是应该的，毫不领情；一旦病治不好，医生立刻就成了杀人凶手，轻则被告上法庭，重则遭打杀报复。生老病死本是自然过程，况且有些病的确是目前医学上解决不了的难...<a href=\"/1065203750/Ebqf76TWj\">展开全文<i >c</i></a>', '');
INSERT INTO `weibo` VALUES (13, '佳佳wk0Y', '2016-10-06 13:12:00', '//<a href=\"http://weibo.com/n/%E7%A8%8B%E5%BA%8F%E5%91%98%E9%82%B9%E6%AC%A3?from=feed&amp;loc=at\">@程序员邹欣</a>: <img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/d0/z2_org.gif\">//<a href=\"http://weibo.com/n/%E5%AF%82%E9%9D%99%E6%B0%B4%E4%B8%96%E7%95%8C?from=feed&amp;loc=at\">@寂静水世界</a>:转发微博', NULL, 0, '学术大观察', '2016-10-06 11:54:00', '【清华大三学生28万字的乡村调查纪实】在乡村建设问题上，知识分子是缺位的，这是农村诸多建设出现停滞甚至倒退的一个重要原因。乡村建设最不缺乏的是清谈雄辩和书斋里的隐士。没有滚足泥土，坐在象牙塔里想象底层的光明或黯淡，纵有造福底层的愿望，也可能背离底层福祉。', '<img src=\"http://ww3.sinaimg.cn/mw690/0063idcugw1f8ierr7zmij30hselsnpe.jpg\"><i  style=\"display:none;\"></i>\n                            <i >长图</i>');
INSERT INTO `weibo` VALUES (14, '佳佳wk0Y', '2016-10-06 02:08:00', '//<a href=\"http://weibo.com/n/%E6%99%93%E9%9B%A8%E9%97%BB%E9%93%83?from=feed&amp;loc=at\">@晓雨闻铃</a>: //<a href=\"http://weibo.com/n/%E8%8C%83%E5%89%91%E5%B9%B3?from=feed&amp;loc=at\">@范剑平</a>: 高，实在是高。', NULL, 0, 'wzm102400', '2016-10-05 06:42:00', '各地正在房地产去杠杆比赛，首付比例一个比一个高，看似调控房地产决心一个比一个大，实际上还是在双限保价，让有房的卖不出，让有钱的买不到，将房地产泡沫冻结！这样的结果不是调控过高的房价而是控制交易量，类似股市的涨停板，买不进会刺激需求预期，也就是涨价预期！如此调控太荒唐！', '');
