INSERT INTO `weibo` VALUES (20, '佳佳wk0Y', '2016-09-24 18:46:00', '//<a href=\"http://weibo.com/n/%E7%A8%8B%E5%BA%8F%E5%91%98%E9%82%B9%E6%AC%A3?from=feed&amp;loc=at\">@程序员邹欣</a>: //<a href=\"http://weibo.com/n/clueless?from=feed&amp;loc=at\">@clueless</a>:也不能说同道德没有关系，守法就是最低线的道德//<a href=\"http://weibo.com/n/%E7%8E%8B%E5%B0%8F%E5%A6%AE?from=feed&amp;loc=at\">@王小妮</a>://<a href=\"http://weibo.com/n/%E6%BC%AB%E6%B8%B8%E8%80%85%E7%B2%92%E5%AD%90?from=feed&amp;loc=at\">@漫游者粒子</a>:', NULL, 0, '丰佐先生', '2016-09-23 23:23:00', 'Kevin:和美国人道德无关，是违法代价太大。以纽约州为例，根据州交通法 VTL 1174(a).条款。校车上下学生期间不停车等待，第一次违反，法官可判处90天监禁外加巨额罚款和扣5分学习，第二次或第三次再违反的，可判处入狱180天，吊销驾照3年。面对如此严苛的律例，你敢不停吗？ <a href=\"http://t.cn/R590SWH\"><i >L</i>秒拍视频</a>', '<img src=\"http://ww3.sinaimg.cn/mw690/736f0c7ejw1f3cb6z7jl9j20nk0dcn0f.jpg\"><i ></i><a>小窗口</a>');
