INSERT INTO `weibo` VALUES (74, '佳佳wk0Y', '2016-07-11 03:10:00', '//<a href=\"http://weibo.com/n/%E6%99%93%E9%9B%A8%E9%97%BB%E9%93%83?from=feed&amp;loc=at\">@晓雨闻铃</a>: →_→北洋将军没有怂人。<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/d0/z2_org.gif\">//<a href=\"http://weibo.com/n/%E6%9D%A8%E4%BD%A9%E6%98%8C?from=feed&amp;loc=at\">@杨佩昌</a>: //<a href=\"http://weibo.com/n/%E7%93%A6%E5%B0%94%E7%99%BB%E6%B9%96%E7%9A%84%E9%81%90%E6%83%B3?from=feed&amp;loc=at\">@瓦尔登湖的遐想</a>://<a href=\"http://weibo.com/n/%E9%82%B5%E6%98%8E%E6%B3%A2?from=feed&amp;loc=at\">@邵明波</a>:转发微博', NULL, 0, '河南新闻哥v', '2016-07-10 08:17:00', '【请别再诬称北洋政府\"卖国\"好不好】 顾维钧是北洋政府曹锟总统时期的外交总长，1924年5月31日顾与苏联经艰苦谈判终于签订《中俄解决悬案大纲协定》，除承认外蒙是中国领土外，还废除了中俄一切不平等条约，苏俄归还中方354.8万平方公里，接近十个日本的国土，同时苏俄放弃庚子赔款。想想谁才真卖国？', '<img src=\"http://ww3.sinaimg.cn/mw690/006p1NuXjw1f5ohyh8w2uj308c0cb74p.jpg\"><i  style=\"display:none;\"></i>');
