INSERT INTO `weibo` VALUES (83, '佳佳wk0Y', '2016-07-01 08:48:00', '//<a href=\"http://weibo.com/n/%E4%B8%AD%E7%A7%91%E5%A4%A7%E8%83%A1%E4%B8%8D%E5%BD%92?from=feed&amp;loc=at\">@中科大胡不归</a>: 为啥民众声讨不绝于耳？显然，这份修订意见与当面面临的工作的机遇和挑战，与广大民众的期待，有相当的差距。近些年来，民众对民族宗教政策的质疑声不断高涨，事出有因。', NULL, 0, '习五一', '2016-07-01 08:14:00', '【以改革思维修订《城市民族工作条例》】<br> 6月29日国务院法制办公室公布国务院关于修改《城市民族工作条例》的决定(征求意见稿)。（以下简称征求意见稿）非议之声此起彼伏。《城市民族工作条例》制定于1993年。20多年来，随着各民族群众跨城乡跨区域跨行业流动加快，对民族工作和城市工作产生重要影响...<a href=\"/1442246695/DCKfg9reA\">展开全文<i >c</i></a>', '<img src=\"http://ww2.sinaimg.cn/mw690/55f6f027jw1f5e39efnkdj20wt0nbdnn.jpg\"><i  style=\"display:none;\"></i>');
