INSERT INTO `weibo` VALUES (85, '佳佳wk0Y', '2016-06-27 13:37:00', '//<a href=\"http://weibo.com/n/orroz?from=feed&amp;loc=at\">@orroz</a>: 长文体验确实很烂，我捐10升97号的。。。<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/b6/doge_org.gif\">//<a href=\"http://weibo.com/n/Laruence?from=feed&amp;loc=at\">@Laruence</a>: 我捐5升!//<a href=\"http://weibo.com/n/%E5%90%B4%E6%A1%91%E5%95%8A?from=feed&amp;loc=at\">@吴桑啊</a>: //<a href=\"http://weibo.com/n/%E5%88%B0%E5%A4%84%E5%90%83247?from=feed&amp;loc=at\">@到处吃247</a>: 有的直接不看了，有的看完之后再手动取关', NULL, 0, '梁欢', '2016-06-26 23:21:00', '微博最近更新了一个功能，一篇长微博用户只能看一部分，想再往下看，需要点「继续阅读，并关注作者」，这是我见过的最愚蠢的产品决策之一。看一篇文章是一个比较随意的行为，而关注一个人则是关乎筛选信息流的重大决策，逼迫用户为了前者去做后者，简直匪夷所思。用户在这样的场景下只可能感到被冒犯。', '<img src=\"http://ww4.sinaimg.cn/mw690/45357f25jw1f591aukugsj20j404gdfz.jpg\"><i  style=\"display:none;\"></i>');
INSERT INTO `weibo` VALUES (86, '佳佳wk0Y', '2016-06-25 23:24:00', '转发微博', NULL, 0, '视觉机器人', '2016-06-25 22:40:00', '【发明】科幻走进现实——Triton，世界首款人造鱼鳃水下呼吸器。使用渗透膜技术，直接从水中源源不断提取氧气，内置双增压马达和大容量电池，一节电池可以在水底自由呼吸45分钟。操作也很简单，咬在嘴里就可使用。  <a href=\"http://t.cn/R50LTLx\"><i >L</i>秒拍视频</a>', '<img src=\"http://dlqncdn.miaopai.com/stream/U8nhwjGA56YsZjDq6SxOTQ___m.jpg\"><i ></i><a>小窗口</a>');
INSERT INTO `weibo` VALUES (87, '佳佳wk0Y', '2016-06-25 14:36:00', '//<a href=\"http://weibo.com/n/%E8%A7%86%E8%A7%89%E6%9C%BA%E5%99%A8%E4%BA%BA?from=feed&amp;loc=at\">@视觉机器人</a>: 不敢想象，10年后多少人没饭吃了//<a href=\"http://weibo.com/n/%E8%BE%BE%E8%8A%AC%E5%A5%87%E7%9A%84%E6%81%B6%E9%AD%94%E6%B2%A1%E6%9C%89%E7%AC%AC%E5%9B%9B%E5%AD%A3%E4%BA%86?from=feed&amp;loc=at\">@达芬奇的恶魔没有第四季了</a>: 屌丝们颤抖吧！你们就要永远地失业了！', NULL, 0, '视觉机器人', '2016-06-24 19:21:00', '重磅！！今天波士顿动力推出最新SpotMini机器人，是一个更小的版本，重达55磅的全电动无液压的机器人，一次充电可运行约90分钟。 SpotMini是我们有史以来最安静的机器人之一。它有各种传感器，包括深度摄像头，固态陀螺仪（IMU）和本体传感器四肢。这些传感器帮助导航和移动操作。 <a href=\"http://t.cn/R5Wm7st\"><i >L</i>秒拍视频</a>', '<img src=\"http://ww3.sinaimg.cn/mw690/736f0c7ejw1f56jbb2dj0j20bu06kq3h.jpg\"><i ></i><a>小窗口</a>');
