INSERT INTO `weibo` VALUES (102, '佳佳wk0Y', '2016-06-18 14:04:00', '转发微博', NULL, 0, '视觉机器人', '2016-06-18 13:30:00', '93岁日本老奶奶的“手鞠”作品吧！日语叫做“てまり”，就是“手鞠”或者“手毬”。在日本是非常受女孩子欢迎的玩具。在日本的江户时代到明治期间，它只是在新年才能玩儿的一种玩具，但现在已经是不分季节，常年可以玩耍。“手鞠”就是在“蹴鞠”的基础上进行的一种日式改良的作品。', '<img src=\"http://ww4.sinaimg.cn/mw690/0060jr72jw1f4zbd3n6ucj30gj0fhadj.jpg\">\n                                                <img src=\"http://ww3.sinaimg.cn/mw690/0060jr72jw1f4zbd4g6kvj30gj0g076x.jpg\">\n                                                <img src=\"http://ww1.sinaimg.cn/mw690/0060jr72jw1f4zbd50y9cj30gj0g4n03.jpg\">\n                                                <img src=\"http://ww2.sinaimg.cn/mw690/0060jr72jw1f4zbd5ei38j30gj0fz41n.jpg\">\n                                                <img src=\"http://ww4.sinaimg.cn/mw690/0060jr72jw1f4zbd67vdtj30gj0g0gp1.jpg\">\n                                                <img src=\"http://ww3.sinaimg.cn/mw690/0060jr72jw1f4zbd6s2qbj30gj0b2q5l.jpg\">\n                                                <img src=\"http://ww2.sinaimg.cn/mw690/0060jr72jw1f4zbd7a3d4j30gj0b0dip.jpg\">\n                                                <img src=\"http://ww1.sinaimg.cn/mw690/0060jr72jw1f4zbd7sqqoj30fe0jg75b.jpg\">\n                                                <img src=\"http://ww3.sinaimg.cn/mw690/0060jr72jw1f4zbd8j91qj30gj0b2n03.jpg\">');
