INSERT INTO `weibo` VALUES (108, '佳佳wk0Y', '2016-06-08 23:12:00', '//<a href=\"http://weibo.com/n/%E6%99%93%E9%9B%A8%E9%97%BB%E9%93%83?from=feed&amp;loc=at\">@晓雨闻铃</a>: 严惩渎职。//<a href=\"http://weibo.com/n/%E4%BD%86%E6%96%8C?from=feed&amp;loc=at\">@但斌</a>: //<a href=\"http://weibo.com/n/%E6%98%93%E5%AF%8C%E8%B4%A4?from=feed&amp;loc=at\">@易富贤</a>:国家卫计委以超生漏报为由将2000年1.22的生育率篡改为1.8，将2010年1.18的生育率篡改为1.6，根据他们的理论，1990年以来共有6000多万是超生漏报了。现在只摸排无户口人员109.8万人，即便真实数据10倍于此数，也说明国家卫计委修改生育率的理由不成立。', NULL, 0, '央视新闻', '2016-06-08 19:35:00', '【公安部：不管无户口人员是哪个年代、什么原因，都要及时落户 绝不允许再设障碍！】今年前5个月，各地共摸排无户口人员109.8万人，其中74.6万无户口人员已办理了户口登记。公安部副部长黄明表示，不管无户口人员问题是哪个年代、什么原因产生，都要及时办理落户，绝不允许再为公民登记户口设置障碍。...<a href=\"/2656274875/DzjSnmfzX\">展开全文<i >c</i></a>', '<img src=\"http://ww4.sinaimg.cn/mw690/9e5389bbjw1f4o1q2g3nlj20f809zgmg.jpg\"><i  style=\"display:none;\"></i>');
