INSERT INTO `weibo` VALUES (143, '佳佳wk0Y', '2016-05-08 23:15:00', '//<a href=\"http://weibo.com/n/%E6%99%93%E9%9B%A8%E9%97%BB%E9%93%83?from=feed&amp;loc=at\">@晓雨闻铃</a>: 回复<a href=\"http://weibo.com/n/saddie?from=feed&amp;loc=at\">@saddie</a>:银行为了换回流动性必须处理不良资产，拍卖不良资产进一步压低质押品的价格，循环往复，，，，，这就是各国各地房地产泡沫破裂后跌幅没有小于70%的原因。 //<a href=\"http://weibo.com/n/%E6%99%93%E9%9B%A8%E9%97%BB%E9%93%83?from=feed&amp;loc=at\">@晓雨闻铃</a>:坐等拍卖银行不良资产。<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/6d/yx_org.gif\">', NULL, 0, '牛的海', '2016-05-08 21:30:00', '“1997年的时候我买了一套价值742万港元的房子，从银行贷了667.8万港元，可这间住宅到2003年就只值250万港元了。”在香港一家律师行工作的赵伟（化名），最终由于无法拿出更多现金来弥补抵押品的价值不足，不仅房子被银行无情收走，而且还欠下银行200多万港元。<br>这是怎么回事？<br>我们知道，作为贷款人，...<a href=\"/2595669667/DuCnw1nuS\">展开全文<i >c</i></a>', '');
