INSERT INTO `weibo` VALUES (153, '佳佳wk0Y', '2016-05-06 08:26:00', '转发微博', NULL, 0, '一个有点理想的记者', '2016-05-05 23:11:00', '这张图也许可以成为医疗界的年度图片之一，人头攒动，全副武装，奔向战场，却又显得如此悲壮。广东省人民医院的医生除正在病患岗位外全体总动员，抢救被砍三十多刀生命危在旦夕的口腔科陈仲伟主任。～这不仅是对生命的一次拯救，更是凝聚了无数医生对同行的祈福。望平安。', '<img src=\"http://ww3.sinaimg.cn/mw690/71ad0be1jw1f3kwr1tj3ej20hs0m0gne.jpg\"><i  style=\"display:none;\"></i>');
INSERT INTO `weibo` VALUES (154, '佳佳wk0Y', '2016-05-06 08:25:00', '吸烟的人就是傻叉，强迫别人洗二手烟的最傻叉//<a href=\"http://weibo.com/n/%E7%A8%8B%E5%BA%8F%E5%91%98%E9%82%B9%E6%AC%A3?from=feed&amp;loc=at\">@程序员邹欣</a>: <img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/d9/lazhuv2_org.gif\">//<a href=\"http://weibo.com/n/%E7%A7%91%E5%AD%A6%E5%85%AC%E5%9B%AD?from=feed&amp;loc=at\">@科学公园</a>: 权威杂志《柳叶刀》曾刊登过我国科学家钟南山先生的文章，指出在我国因吸烟和固体燃料燃烧导致的可吸入颗粒物污染，将在2003-2033年间导致6千5百万人死于慢性肺病，1千8百万人死于肺癌', NULL, 0, '科学公园', '2016-05-05 11:00:00', '【雾霾危害有多大？】<a href=\"http://weibo.com/n/%E7%99%BE%E4%BA%BA%E6%96%87%E5%8C%96--%E8%B5%9B%E5%85%88%E7%94%9F?from=feed&amp;loc=at\">@百人文化--赛先生</a> ，生活在北方城市的人们近三年普遍感受到，雾霾的发生频率在不断增加，特别是2013年和2014年， 雾霾发生的次数之频繁，持续时间之长，污染程度之重都创下了记录，2013年1月北京发生了 PM2.5污染历史峰值。<a href=\"http://t.cn/Rq8SvP0\"><i >O</i>雾霾危害有多大？</a>', '<img src=\"http://ww4.sinaimg.cn/mw690/88fd3e09jw1f3kbsiz3pwj209c0efjt3.jpg\"><i  style=\"display:none;\"></i>');
