INSERT INTO `weibo` VALUES (158, '佳佳wk0Y', '2016-04-29 20:22:00', '转发微博', NULL, 0, '界面', '2016-04-27 15:40:00', '【疯狂的手串——文玩时代的泡沫】像曾经涌入兰花、藏獒、普洱一样，数不清的热钱涌入了手串江湖。它不再只是细致精巧的玩物，而是万千人寄托梦想、发家致富的法门。不过背后的操盘手们有能力将手串的交易价格联手推上顶峰，却无法阻止泡沫破裂后的急速坠落。 <a href=\"http://t.cn/RqWE8Ww\"><i >°</i>疯狂的手串——文玩时代的泡沫</a>', '<a>\n                    <img src=\"http://ww1.sinaimg.cn/crop.0.0.580.325.1000.562/005EHRy1jw1f3b9f36ttlj30g4096wft.jpg\"></a>\n                \n                                            界面\n                                                        \n                <em ></em>\n            \n            \n                \n                    <h4 >疯狂的手串——文玩时代的泡沫</h4>');
