INSERT INTO `weibo` VALUES (187, '佳佳wk0Y', '2016-03-27 00:45:00', '//<a href=\"http://weibo.com/n/%E6%99%93%E9%9B%A8%E9%97%BB%E9%93%83?from=feed&amp;loc=at\">@晓雨闻铃</a>: 暮年才敢说真话，民族的悲哀。 //<a href=\"http://weibo.com/n/%E6%9D%A8%E4%BD%A9%E6%98%8C?from=feed&amp;loc=at\">@杨佩昌</a>:这个国家还需要一个将近九十的老人来普及常识<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/9d/sada_org.gif\"> //<a href=\"http://weibo.com/n/%E5%BE%90%E6%98%95?from=feed&amp;loc=at\">@徐昕</a>:<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/d0/z2_org.gif\"> //<a href=\"http://weibo.com/n/%E7%AB%A0%E8%AF%92%E5%92%8C?from=feed&amp;loc=at\">@章诒和</a>: //<a href=\"http://weibo.com/n/%E6%B8%85%E5%8D%8E%E9%83%AD%E4%BA%8E38%E5%8D%8E?from=feed&amp;loc=at\">@清华郭于38华</a>: 顶茅老<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/d0/z2_org.gif\"><img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/d0/z2_org.gif\"><img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/d0/z2_org.gif\"> //<a href=\"http://weibo.com/n/%E9%80%83%E5%BE%97%E4%BA%86%E8%96%84_%E8%BA%B2%E4%B8%8D%E8%BF%87%E5%88%81_2?from=feed&amp;loc=at\">@逃得了薄_躲不过刁_2</a>: <img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/d8/good_org.gif\"><img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/d8/good_org.gif\"><img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/d8/good_org.gif\">说的好！', NULL, 0, '茅于轼', '2016-03-26 18:09:00', '各人都爱自己的国家，仇视别的国家，就容易发生战争。所以普世价值里没有爱国这一条。要用爱人代替爱国，对世界和平更有好处。既爱国又爱民是最好，但是有时候爱国和爱民有冲突，我们应该选择爱民而不是爱国。当然，政治家可能不是这样想问题的，他们多半把爱国放在高于一切的地位，把爱国变成了热爱国...<a href=\"/1235457821/Do3GAs8K4\">展开全文<i >c</i></a>', '');
