INSERT INTO `weibo` VALUES (189, '佳佳wk0Y', '2016-03-23 23:54:00', '//<a href=\"http://weibo.com/n/%E8%80%81%E9%BD%90Py?from=feed&amp;loc=at\">@老齐Py</a>: 转发微博', NULL, 0, 'Ming_the_Great_大明', '2016-03-22 23:21:00', '「古巴宣布解禁 Google, Facebook ，Google 发表声明，愿意帮助包括古巴在内的所有第三世界公民免费上网，共享21世纪人类文明财富……目前全球还有两个国家不能使用 Google 和 Facebook：北朝鲜和其它国家。」', '<img src=\"http://ww4.sinaimg.cn/mw690/8a805d80gw1f261x2932vj20hs0mijsn.jpg\"><i  style=\"display:none;\"></i>');
INSERT INTO `weibo` VALUES (190, '佳佳wk0Y', '2016-03-21 21:18:00', '//<a href=\"http://weibo.com/n/%E8%80%81%E9%BD%90Py?from=feed&amp;loc=at\">@老齐Py</a>: //<a href=\"http://weibo.com/n/%E5%AD%99%E5%81%A5%E5%8A%9B?from=feed&amp;loc=at\">@孙健力</a>://<a href=\"http://weibo.com/n/%E9%A9%AC%E4%BC%AF%E5%BA%B8?from=feed&amp;loc=at\">@马伯庸</a>:正确方向//<a href=\"http://weibo.com/n/%E8%92%8B%E8%83%9C%E7%94%B7?from=feed&amp;loc=at\">@蒋胜男</a>: 终于开始国内有判例了。//<a href=\"http://weibo.com/n/%E9%99%88%E9%87%8C?from=feed&amp;loc=at\">@陈里</a>: <a href=\"http://huati.weibo.com/k/%E5%90%91%E6%A0%A1%E5%9B%AD%E6%9A%B4%E5%8A%9B%E8%AF%B4%E4%B8%8D?from=501\">#向校园暴力说不#</a>这期案件的判决具有典型意义。希望网友们转发评论。希望学校、家长们，立法、司法、执法机关能够参与研讨评论，发布各自的看法。希望校园暴力、青少年暴力有所遏制。谢谢各位！', NULL, 0, '新闻之爆料人', '2015-11-07 20:23:00', '<a href=\"http://huati.weibo.com/k/%E6%96%B0%E9%97%BB%E4%B9%8B%E7%88%86%E6%96%99%E4%BA%BA?from=501\">#新闻之爆料人#</a> 今年5月，连云港广播电视大学一女生遭多名女生剥光衣服殴打并拍照上传。3日，海州区人民法院判决4名施暴女生犯故意伤害罪、强制侮辱妇女罪分别领刑2年半至6年半不等。审判长表示，全国多起同类案件中鲜有嫌疑人被判刑，大多以被学校开除或治安处罚结束，希望此案能起到警示作用', '<img src=\"http://ww3.sinaimg.cn/mw690/95812192gw1exsohxrf1yj207q09j74e.jpg\">\n\n                                \n                <img src=\"http://ww1.sinaimg.cn/mw690/95812192gw1exsohyufy1j20c809374i.jpg\">');
