INSERT INTO `weibo` VALUES (212, '佳佳wk0Y', '2016-02-29 23:08:00', '台下好几位大神，Linus Torvalds在座', NULL, 0, '视觉机器人', '2016-02-29 20:12:00', '<a href=\"http://huati.weibo.com/k/TED%E6%BC%94%E8%AE%B2?from=501\">#TED演讲#</a>  见识一下各种令人眼花缭乱的未来飞行器，是的，不是无人机。这是瑞士苏黎世联邦理工自动化专家Raffaello D\'Andrea的2016年2月最新无人机研究项目的公开演讲。并展示了各种各样的未来飞行器的雏形，中文译稿参见<a href=\"http://t.cn/RGpzzbb\"><i >O</i>机器之心</a> （花了我很长时间秒拍传不上<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/9d/sada_org.gif\">）<a href=\"http://t.cn/RGpzXU1\"><i >L</i>ETH PX4无人机项目最新技术公开演讲！</a>', '<a href=\"http://t.cn/RGpzXU1\">                                                                                    <img src=\"http://vpic.video.qq.com/76797751/g01859la318_1.jpg\"></a>                                                                                                                                <h4 ><a href=\"http://t.cn/RGpzXU1\">ETH PX4无人机项目最新技术公开演讲！</a></h4>                                                                        瑞士苏黎世联邦理工自动化专家Raffaello D\'Andrea最新无人机研究项目的公开演讲。Raffaello带领其团队与全世界的工程师，爱好者，艺术家和企业家一起开展先进无人系统的自动化研究，这项有意义的工作不仅将无人机的应用边界拓展到了新的维度，而且其打造的炫酷飞行机器人告诉了我们——无人机不只是用来航拍的玩具，而是来自未来的终极工具！');
INSERT INTO `weibo` VALUES (213, '佳佳wk0Y', '2016-02-29 22:52:00', '转发微博', NULL, 0, '视觉机器人', '2016-02-29 21:24:00', '<a href=\"http://huati.weibo.com/k/%E8%A7%86%E9%A2%91?from=501\">#视频#</a> 这个乐器由Tim Meeks在2007年开发制作，是新型的电子弦乐器，乐器的特点是共同拥有吉他和钢琴的音色。我觉得这个好复杂啊，不过曲子还挺好听的~~ <a href=\"http://t.cn/RGpLktL\"><i >L</i>秒拍视频</a>', '<img src=\"http://ww3.sinaimg.cn/mw690/6117d2a0jw1f1d5942nqbj20no0dc754.jpg\"><i ></i><a>小窗口</a>');
