INSERT INTO `weibo` VALUES (273, '佳佳wk0Y', '2016-01-10 16:00:00', '转发微博', NULL, 0, '延参法师', '2016-01-10 15:42:00', '一位女士网友来短信诉说苦恼，逢年过节家里人催婚催的紧，难道大龄未嫁好像比自然灾害还严重似的，怎么周旋才好呢？我回复她，虽然不算啥自然灾害，但也要多理解家人的关怀，自己工作单位没啥合适的菜，不妨去其他单位瞅瞅有啥合适的剩菜呗。', '');
INSERT INTO `weibo` VALUES (274, '佳佳wk0Y', '2016-01-10 16:00:00', '//<a href=\"http://weibo.com/n/%E8%A7%A6%E5%8A%A8%E5%BF%83%E7%81%B5%E7%9A%84%E8%8B%B1%E6%96%87%E7%9F%AD%E5%8F%A5?from=feed&amp;loc=at\">@触动心灵的英文短句</a>: 说的很好<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/d0/z2_org.gif\">', NULL, 0, '几米漫画情', '2016-01-10 15:01:00', '真正的好朋友，互损不会翻脸，出钱不会计较，地位不分高低，成功无需巴结，失败不会离去。迷茫的时候拉一把，难过的时候抱一下。随着年龄的增长，身边的朋友越来越多，但是真心的朋友会越来越少，只有留下来的才是真正的朋友，他们不忘彼此，不说谢谢！关.注→<a href=\"http://weibo.com/n/%E5%87%A0%E7%B1%B3%E6%BC%AB%E7%94%BB%E6%83%85?from=feed&amp;loc=at\">@几米漫画情</a> 走进几米的世界<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/40/hearta_org.gif\">', '<img src=\"http://ww1.sinaimg.cn/mw690/8debe637gw1ezu9sdqad3j20c80hg77o.jpg\">\n                                                <img src=\"http://ww4.sinaimg.cn/mw690/8debe637gw1ezu9se0k1bj20c80hhacy.jpg\">\n                                                <img src=\"http://ww2.sinaimg.cn/mw690/8debe637gw1ezu9seoz6oj20c80h0goq.jpg\">\n                                                <img src=\"http://ww1.sinaimg.cn/mw690/8debe637gw1ezu9sexy4jj20c80hetc5.jpg\">\n                                                <img src=\"http://ww2.sinaimg.cn/mw690/8debe637gw1ezu9sfapbjj20c80gz40g.jpg\">\n                                                <img src=\"http://ww3.sinaimg.cn/mw690/8debe637gw1ezu9sfo4o5j20c80h3wh7.jpg\">\n                                                <img src=\"http://ww4.sinaimg.cn/mw690/8debe637gw1ezu9sfnkj7j20c80haads.jpg\">\n                                                <img src=\"http://ww1.sinaimg.cn/mw690/8debe637gw1ezu9sgno8lj20c80hatbz.jpg\">\n                                                <img src=\"http://ww4.sinaimg.cn/mw690/8debe637gw1ezu9shi890j20c80fxq6l.jpg\">');
