INSERT INTO `weibo` VALUES (341, '佳佳wk0Y', '2015-11-08 22:50:00', '转发微博', NULL, 0, '萌猫小百科', '2015-11-08 17:00:00', '美国一只猫咪叫罗拉，一天女主人安妮在帮她洗澡，不过罗拉似乎很怕水，一碰到水就会说中文的巧克力，而且还不断重复。。。女主人开玩笑说，不知道罗拉是不是疯了。。其实是主人你不懂中文啦<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/6a/laugh.gif\"><a href=\"http://t.cn/RAJr73v\"><i >L</i>微博视频</a>', '<img src=\"http://ww4.sinaimg.cn/mw690/3fe62659jw1f4uu9wiiz6j20dc0a0wei.jpg\"><i ></i><a>小窗口</a>');
