INSERT INTO `weibo` VALUES (346, '佳佳wk0Y', '2015-10-29 21:36:00', '善良和单纯总是被当作愚蠢，直到所有人都变得所谓的聪明。', NULL, 0, '梅西大学MasseyUni', '2015-10-27 22:25:00', '鸮鹦鹉，新西兰独有濒危鸟类，特征是不会飞、肥、而且好奇心重，如果在丛林里发现人类就会（自以为神不知鬼不觉的）靠近观察，受到惊吓就会全身僵硬，一动也不动。因为太蠢又很美味，性格像狗喜欢亲近人类，被人类和野猫捕杀的仅剩120只。<a href=\"http://huati.weibo.com/k/%E6%AF%8F%E5%A4%A9%E6%B6%A8%E5%A7%BF%E5%8A%BF?from=501\">#每天涨姿势#</a>', '<img src=\"http://ww3.sinaimg.cn/mw690/005wIYpnjw1exg27fpg82g306t05kx6p.gif\"><i >GIF</i>\n                                    \n                                                                            \n                    <img src=\"http://ww4.sinaimg.cn/mw690/005wIYpnjw1exg27a92jtg306t05kx6p.gif\"><i >GIF</i>\n                                    \n                                                                            \n                    <img src=\"http://ww2.sinaimg.cn/mw690/005wIYpnjw1exg2707r54g306t046e33.gif\"><i >GIF</i>\n                                    \n                                                                            \n                    <img src=\"http://ww2.sinaimg.cn/mw690/005wIYpnjw1exg27aia33g306t05kx6p.gif\"><i >GIF</i>\n                                    \n                                                                            \n                    <img src=\"http://ww3.sinaimg.cn/mw690/005wIYpnjw1exg26z1fz5g30b406a1kx.gif\"><i >GIF</i>\n                                    \n                                                                            \n                    <img src=\"http://ww4.sinaimg.cn/mw690/005wIYpnjw1exg274dwh8g30dw0aiqv3.gif\"><i >GIF</i>\n                                    \n                                                                            \n                    <img src=\"http://ww1.sinaimg.cn/mw690/005wIYpnjw1exg26xy16rg306y04te1m.gif\"><i >GIF</i>');
