INSERT INTO `weibo` VALUES (365, '佳佳wk0Y', '2015-08-22 21:58:00', '<a href=\"http://weibo.com/n/%E5%B0%8F%E5%84%BF%E5%A4%96%E7%A7%91%E9%A9%AC%E6%A5%A0%E5%8C%BB%E7%94%9F?from=feed&amp;loc=at\">@小儿外科马楠医生</a> //<a href=\"http://weibo.com/n/%E7%A8%8B%E5%BA%8F%E5%91%98%E9%82%B9%E6%AC%A3?from=feed&amp;loc=at\">@程序员邹欣</a>: //<a href=\"http://weibo.com/n/siningwei?from=feed&amp;loc=at\">@siningwei</a>:转发微博', NULL, 0, '耳帝', '2015-08-17 21:49:00', '一位歌剧演员得了脑肿瘤，需要做开颅手术。但是为了防止手术破坏他控制唱歌的脑神经，主刀医生建议他做清醒开颅，一边做手术一边唱歌剧好让医生观测。这位演员唱的是舒伯特的《冬之旅·晚安》，画面简直古典朋克范儿！2分10秒处你还可以清楚地观察到神经是如何控制走音的有趣瞬间。<a href=\"http://t.cn/RLd1DHh\"><i >L</i>秒拍视频</a>', '<img src=\"http://ww3.sinaimg.cn/sq480/736f0c7ejw1ev5xhwfkepj20nq0dc77m.jpg\"><i ></i><a>小窗口</a>');
