INSERT INTO `weibo` VALUES (378, '佳佳wk0Y', '2015-08-11 13:21:00', '转发微博', NULL, 0, '与欧洲有关的一切', '2015-08-11 11:30:00', '【TED演讲：什么是最好的结婚对象】 她叫Tracy McMillan，母亲是性工作者，父亲大半生在监狱度过，9岁前被超过20个家庭寄养。她曾以为结婚是依靠，三次失败的婚姻过后，她开始了对自我的思考。听离过3次婚的女人讲婚姻观：你希望别人爱你，就先爱自己。<a href=\"http://weibo.com/n/%E9%98%BF%E5%B0%94%E6%B3%95%E5%B0%8F%E5%88%86%E9%98%9F?from=feed&amp;loc=at\">@阿尔法小分队</a> <a href=\"http://t.cn/RLQvbSX\"><i >O</i>网页链接</a>', '<img src=\"http://ww4.sinaimg.cn/mw690/85d1229fjw1euyhxbanisj20c80iz40e.jpg\"><i  style=\"display:none;\"></i>');
