INSERT INTO `weibo` VALUES (387, '佳佳wk0Y', '2015-07-30 19:43:00', '我个矮，所以转发了', NULL, 0, '全球健身中心', '2015-07-30 18:07:00', '【 人类最理想身高168厘米】科学家从适应现代化生产等角度研究发现，人类最理想身高为168厘米，最佳变动范围是167~170厘米。人的身高每增高10厘米，体重就增加16%；身高每增加2.5厘米，就多消耗5%的能量。身材高大的人血液循环路线较长，心脏负担较重，很可能会影响寿命。你觉得怎样？<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/6a/laugh.gif\">', '<img src=\"http://ww2.sinaimg.cn/mw690/7faee44fgw1eukylnx4cmj209m08x0su.jpg\"><i  style=\"display:none;\"></i>');
