INSERT INTO `weibo` VALUES (410, '佳佳wk0Y', '2015-07-15 22:42:00', '生物界的BUG', NULL, 0, '老阿姨在看着你', '2015-07-15 21:15:00', '【Tardigrade】今天看大圣归来，看到混沌出现的时候，满脑子都是Tardigrade(缓步动物门)。也称俗称“水熊虫”，因为有全部四种隐生性，能够在高温(151度)、接近绝对零度(-272.8度)、高辐射、真空或高压的环境下生存数分钟至数日等多种奇葩属性，外加动起来又笨友萌，被誉为生物界的BUG。图8.9为gif。', '<img src=\"http://ww4.sinaimg.cn/mw690/67197f43jw1eu3ro6gv32j20hr0e2jtg.jpg\">\n                                                <img src=\"http://ww1.sinaimg.cn/mw690/67197f43jw1eu3ro7i2kgj20d00bh752.jpg\">\n                                                <img src=\"http://ww4.sinaimg.cn/mw690/67197f43jw1eu3ro99mhij20h80acta4.jpg\">\n                                                <img src=\"http://ww1.sinaimg.cn/mw690/67197f43jw1eu3rob1grxj20eq0ayjth.jpg\">\n                                                <img src=\"http://ww3.sinaimg.cn/mw690/67197f43jw1eu3rodqowfj20sg0nagtr.jpg\">\n                                                <img src=\"http://ww4.sinaimg.cn/mw690/67197f43jw1eu3roeliv2j208006l0t5.jpg\">\n                                                <img src=\"http://ww1.sinaimg.cn/mw690/67197f43jw1eu3roha5n2j20a30dw764.jpg\">\n                                                <img src=\"http://ww2.sinaimg.cn/mw690/67197f43jw1eu3rovvnfbg20dw04vquq.gif\"><i >GIF</i>                                                                            <img src=\"http://ww4.sinaimg.cn/mw690/67197f43jw1eu3rplr581g20a706bx6p.gif\"><i >GIF</i>');
