INSERT INTO `weibo` VALUES (494, '佳佳wk0Y', '2015-04-10 21:26:00', '转发微博', NULL, 0, '设计目录', '2015-04-10 20:47:00', '英國業余攝影師迪恩·梅森近日拍攝到了有趣的一幕：兩只小貓頭鷹緊緊貼在一起，旁邊的小貓頭鷹十分羨慕，只見它慢慢來到他兩面前，伸出爪子撓撓兄弟的翅膀，一副求抱抱姿態。一開始兄弟並不願意接納。可最後小貓頭鷹還是成功鉆到了翅膀下，抱成一團。小貓頭鷹是貓頭鷹中一種，身高僅22CM。（高清大圖）', '<img src=\"http://ww4.sinaimg.cn/mw690/8189cc0agw1er0rdx3yl3j20r10i1dl5.jpg\">\n\n                                                                            \n                    <img src=\"http://ww4.sinaimg.cn/mw690/8189cc0agw1er0rdy91kvj20r40gtq86.jpg\">\n\n                                                                            \n                    <img src=\"http://ww4.sinaimg.cn/mw690/8189cc0agw1er0rdz9klqj20r10jejxq.jpg\">\n\n                                                                            \n                    <img src=\"http://ww3.sinaimg.cn/mw690/8189cc0agw1er0re0akhfj20r60j8teo.jpg\">\n\n                                                                            \n                    <img src=\"http://ww1.sinaimg.cn/mw690/8189cc0agw1er0rfinknnj20r50i1gqy.jpg\">\n\n                                                                            \n                    <img src=\"http://ww4.sinaimg.cn/mw690/8189cc0agw1er0rfj3lrnj20r40juafb.jpg\">');
