INSERT INTO `weibo` VALUES (496, '佳佳wk0Y', '2015-04-08 12:59:00', '//<a href=\"http://weibo.com/n/%E7%AB%A0%E8%AF%92%E5%92%8C?from=feed&amp;loc=at\">@章诒和</a>: //<a href=\"http://weibo.com/n/%E9%99%88%E8%BF%9C?from=feed&amp;loc=at\">@陈远</a>: <img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/6a/laugh.gif\">', NULL, 0, '雷颐', '2015-04-08 10:44:00', '(转）仇和倒台，最悲催的是某大学一名博士生，他准备了几年的博士论文——《仇和的政治艺术》即将答辩，但日前接到通知，要求重新选题。这厮哭了三天三夜，改了一个题目：《仇和的政客伎俩》，导师们纷纷叫好。', '');
