INSERT INTO `weibo` VALUES (504, '佳佳wk0Y', '2015-04-02 23:14:00', '就哭了//<a href=\"http://weibo.com/n/%E8%8B%B1%E5%9B%BD%E6%8A%A5%E5%A7%90?from=feed&amp;loc=at\">@英国报姐</a>: //<a href=\"http://weibo.com/n/%E5%8C%97%E5%A2%83%E6%B0%B8%E4%B8%8D%E9%81%97%E5%BF%98?from=feed&amp;loc=at\">@北境永不遗忘</a>:“我们都有伤疤，外在的或内在的，无论因为什么原因伤在哪个部位，都不会让你和任何人有什么不同。除非你不敢面对，藏起伤口，让那伤在暗地里发脓溃烂，那会让你成为一个病人，而且无论如何假装，都永远正常不了。”', NULL, 0, '英国报姐', '2015-04-02 22:17:00', '埃及的一只猫小时候被大猫狠狠攻击后，就跑进了地铁里的墙体后面，一躲就躲了5年，再没出来过……被戳中，是因为想到了人们。', '<img src=\"http://ww4.sinaimg.cn/mw690/b8b73ba1jw1eqrl2kq1hqj20c82277em.jpg\"><i  style=\"display:none;\"></i>                            <i >长图</i>');
