INSERT INTO `weibo` VALUES (527, '佳佳wk0Y', '2015-03-18 22:04:00', '//<a href=\"http://weibo.com/n/%E4%BC%91%E9%97%B2%E7%92%90?from=feed&amp;loc=at\">@休闲璐</a>: 本山村老尸就随便转转 //<a href=\"http://weibo.com/n/%E5%9B%9E%E5%BF%86%E4%B8%93%E7%94%A8%E5%B0%8F%E9%A9%AC%E7%94%B2?from=feed&amp;loc=at\">@回忆专用小马甲</a>:本木乃伊低调路过<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/70/88_org.gif\">', NULL, 0, '小野妹子学吐槽', '2015-03-18 21:13:00', '以前听过95后的妹子对男生大吼：“你去找你那个92年的老女人吧！”当时就心头一紧，全身发颤；如今更了不得，听外甥女说，她们00后的女生，若是听说有谁找了1997年的对象，就会连连惊叹：“哇塞，和上一个千年的人交往啊，好酷哦……” 听得我扑通一声就跪了<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/70/88_org.gif\">', '');
