INSERT INTO `weibo` VALUES (555, '佳佳wk0Y', '2015-02-18 13:43:00', '转发微博', NULL, 0, '红楼梦张莉', '2015-02-18 11:24:00', '晨曦的第一缕阳光是我对你的深深祝福，夕阳收起的最后一抹殷红是我对你衷心的问候，在新春佳节之际，送上我最真挚的祝福：健康，幸福，快乐每一天，羊年大吉!<a href=\"http://m.weibo.cn/zt/lucky?from=biaoqing\"><img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/cc/yangniandj_org.gif\"></a><a href=\"http://m.weibo.cn/zt/lucky?from=biaoqing\"><img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/cc/yangniandj_org.gif\"></a><a href=\"http://m.weibo.cn/zt/lucky?from=biaoqing\"><img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/cc/yangniandj_org.gif\"></a><img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/6d/lovea_org.gif\"><img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/6d/lovea_org.gif\"><img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/6d/lovea_org.gif\">', '<img src=\"http://ww2.sinaimg.cn/mw690/8436d279jw1epdclafwsej20kk0ymade.jpg\"><i  style=\"display:none;\"></i>');
INSERT INTO `weibo` VALUES (556, '佳佳wk0Y', '2015-02-18 09:22:00', '转发微博', NULL, 0, '咆哮女郎柏邦妮', '2015-02-17 20:22:00', '今儿和我娘聊了一天，感觉她既不发愁，也不害怕，不怕老，也不怕死。反而是她反反复复劝我，不着急结婚，不着急要娃，绝对不要将就，每天都要开心的活。感觉我娘真的是活明白了！我自个儿搁家里呆着，外头零星鞭炮响，突然觉得没什么可怕的，我什么都不缺，也什么都不求。什么都没发生，心里一片喜悦。', '<img src=\"http://ww2.sinaimg.cn/mw690/593f8ffajw1epcmhpxlnzj20hs0vkgq0.jpg\"><i  style=\"display:none;\"></i>');
