INSERT INTO `weibo` VALUES (558, '佳佳wk0Y', '2015-02-13 10:33:00', '转发微博', NULL, 0, '中科大胡不归', '2015-02-13 10:24:00', '【希腊总理和李克强通话：需要中国支持帮助】希腊新总理齐普拉斯和李克强通话：需要中国的支持和帮助。<a href=\"http://t.cn/RwqqQDu\"><i >O</i>网页链接</a>有人说中国因为不普世，所以没朋友。其实根本不是普世的事，穷在闹市无人问，富在深山有远亲。现在实力到了，哪怕坐着不动，对现行国际秩序不满的抱粗腿的上门一大堆。', '<img src=\"http://ww4.sinaimg.cn/mw690/dd260bddjw1ep7iqjdsiuj208m06474g.jpg\"><i  style=\"display:none;\"></i>');
INSERT INTO `weibo` VALUES (559, '佳佳wk0Y', '2015-02-13 10:32:00', '转发微博', NULL, 0, '樊建川', '2015-02-13 07:32:00', '高雄监狱事件：1、仗义，6犯挟持3人，赖副典狱长、王科长主动去把3人换出，陈典狱长又主动去把赖副典狱长换出。2、宏观，6犯提出“法官有罪推论心态要改、保外就医制度不公平”等要求。3、盗亦有道，6犯拥6枪，不困兽斗，不伤无辜，郑立德堂主率众自决，4人先行，2人给前者补弹后，呯！吞弹随行。噫！', '<img src=\"http://ww4.sinaimg.cn/mw690/63eb5b8djw1ep7au9tfi0j20k00dbtb6.jpg\">\n                                                                                                <img src=\"http://ww4.sinaimg.cn/mw690/63eb5b8djw1ep7auacdpwj20go09kdhi.jpg\">\n                                                                                                <img src=\"http://ww2.sinaimg.cn/mw690/63eb5b8djw1ep7auamz1gj20c807f3zi.jpg\">\n                                                                                                <img src=\"http://ww1.sinaimg.cn/mw690/63eb5b8djw1ep7aub2fm9j20go0b30un.jpg\">');
INSERT INTO `weibo` VALUES (560, '佳佳wk0Y', '2015-02-12 08:55:00', '//<a href=\"http://weibo.com/n/%E7%8B%AC%E8%87%AA%E7%AD%89%E5%BE%85%E5%BD%A2%E5%BD%B1%E4%B8%8D%E7%A6%BB?from=feed&amp;loc=at\">@独自等待形影不离</a>: 大部分的懒惰与恐惧有关，恐惧自己学不会新事物、到头来瞎折腾，恐惧自己挖那么多口井却都没挖到水。又懒又怕，怎能心安？', NULL, 0, '百宝彩', '2015-02-11 08:15:00', '<a href=\"http://huati.weibo.com/k/%E5%8B%BF%E5%BF%98%E5%BF%83%E5%AE%89?from=501\">#勿忘心安#</a> 大部分的恐惧与懒惰有关，这句深具道理。我们常常会害怕改变，其实，都是因为自己太懒了，懒得去适应新的环境，懒得去学习新的知识、涉足新的领域，但是，如果总是这样的话，如何能让自己成熟起来呢？—— M·斯科特·派克《少有人走的路》', '<img src=\"http://ww2.sinaimg.cn/mw690/ea7cc1b7jw1ep53s7rvvbj20zk0k0dlh.jpg\"><i  style=\"display:none;\"></i>');
INSERT INTO `weibo` VALUES (561, '佳佳wk0Y', '2015-02-11 18:19:00', '河狸？我知道海狸特别逗', NULL, 0, '英国报姐', '2015-02-11 18:05:00', '摄影师Bettina 和 Christian，他们俩花了10年时间观察河狸，现在河狸们都能认出他们的声音，所以才能拍下特别静距离的照片，第三张萌死了', '<img src=\"http://ww3.sinaimg.cn/mw690/b8b73ba1gw1ep5ktp4452j20hs0bt75a.jpg\">\n                                                <img src=\"http://ww3.sinaimg.cn/mw690/b8b73ba1gw1ep5ktqaywsj20hs0btmyb.jpg\">\n                                                <img src=\"http://ww4.sinaimg.cn/mw690/b8b73ba1gw1ep5ktujix4j213q0nutgy.jpg\">');
INSERT INTO `weibo` VALUES (562, '佳佳wk0Y', '2015-02-11 10:41:00', '//<a href=\"http://weibo.com/n/4A%E5%B9%BF%E5%91%8A%E6%8F%90%E6%A1%88%E7%BD%91?from=feed&amp;loc=at\">@4A广告提案网</a>: 转发微博', NULL, 0, '4A广告提案网', '2014-12-26 11:15:00', '一个老头，一条狗，在新墨西哥州的沙漠里，用了十年的时间挖了一个美到让人窒息的巨大洞穴。Ra Paulette，这个67岁的美国雕刻艺术家，在洞里的每个房间都为它们创造了不同的设计风格。这个老人的经历也是相当丰富：大学辍学、海军、邮递员、保安、清洁工、农民、很长时间的流浪汉。。转', '<img src=\"http://ww1.sinaimg.cn/mw690/6272f4ecjw1enmwunhgfnj20hs0mxn1j.jpg\">\n                                                <img src=\"http://ww2.sinaimg.cn/mw690/6272f4ecjw1enmwus9liqg20ca071qv5.gif\"><i >GIF</i>                                                                            <img src=\"http://ww2.sinaimg.cn/mw690/6272f4ecjw1enmwuultj1g209q05g47u.gif\"><i >GIF</i>                                                                            <img src=\"http://ww1.sinaimg.cn/mw690/6272f4ecjw1enmwuw0guxj20hs1cgn3k.jpg\">\n                                                <img src=\"http://ww1.sinaimg.cn/mw690/6272f4ecjw1enmwuz53xoj20hs1asgse.jpg\">\n                                                <img src=\"http://ww2.sinaimg.cn/mw690/6272f4ecjw1enmwv08nwwj20hs193tfl.jpg\">\n                                                <img src=\"http://ww4.sinaimg.cn/mw690/6272f4ecjw1enmwv19pkxj20hs103gqc.jpg\">\n                                                <img src=\"http://ww3.sinaimg.cn/mw690/6272f4ecjw1enmwv27s79j20hs0y8781.jpg\">\n                                                <img src=\"http://ww1.sinaimg.cn/mw690/6272f4ecjw1enmwv36hkfj20hs0yc0zx.jpg\">');
