INSERT INTO `weibo` VALUES (578, '佳佳wk0Y', '2015-02-01 13:43:00', '童心未泯啊//<a href=\"http://weibo.com/n/%E7%AB%A0%E8%AF%92%E5%92%8C?from=feed&amp;loc=at\">@章诒和</a>: 忙活吧，猫咪！/<a href=\"http://weibo.com/n/%E6%B8%85%E9%A3%8E%E5%AD%90-?from=feed&amp;loc=at\">@清风子-</a>: 夜入民宅，非奸即盗，不围攻你围攻谁？怎么爬进来就怎么爬出去啊，傻孩子！<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/6a/laugh.gif\">//<a href=\"http://weibo.com/n/%E6%88%91%E5%92%8C%E5%AE%A0%E7%89%A9%E7%9A%84%E6%97%A5%E5%B8%B8?from=feed&amp;loc=at\">@我和宠物的日常</a>: 完整版！哈哈哈蠢哭。<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/6a/laugh.gif\">', NULL, 0, '英国报姐', '2015-01-28 13:06:00', '一只误入小鸭窝的喵，没见过那么大阵仗，各种无助，最后一张的眼神楚楚可怜', '<img src=\"http://ww3.sinaimg.cn/mw690/b8b73ba1jw1eop5h4qw4dg205w08s7rv.gif\"><i >GIF</i>\n                                    \n                                                                            \n                    <img src=\"http://ww4.sinaimg.cn/mw690/b8b73ba1jw1eop5h72w2ng205y08se81.gif\"><i >GIF</i>\n                                    \n                                                                            \n                    <img src=\"http://ww1.sinaimg.cn/mw690/b8b73ba1jw1eop5hfg2k4g205y08s4g4.gif\"><i >GIF</i>\n                                    \n                                                                            \n                    <img src=\"http://ww2.sinaimg.cn/mw690/b8b73ba1jw1eop5ihtej9g205y097qv6.gif\"><i >GIF</i>');
INSERT INTO `weibo` VALUES (579, '佳佳wk0Y', '2015-01-31 19:58:00', '真刺激', NULL, 0, '加拿大大教授', '2015-01-31 11:09:00', '今天我走在街上，对面过来一老奶奶，当我跟她擦肩而过的时候，她一把就扶住了我的胳膊，慢慢地就往下躺，我心想完了。 过了二十秒，老奶奶自个又站起来了，拍了拍身上的土。“孩子，刺不刺激，人生到处是惊喜。”说完就走了。 尼玛，英雄不问出处！贪玩不分岁数啊！<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/24/sweata_org.gif\"> 转！', '<img src=\"http://ww3.sinaimg.cn/mw690/e6a570c1jw1eorxx3plxuj208c06i0t4.jpg\"><i  style=\"display:none;\"></i>');
INSERT INTO `weibo` VALUES (580, '佳佳wk0Y', '2015-01-31 19:28:00', '一看就哭了', NULL, 0, '人民网', '2015-01-31 12:51:00', '【她才6岁，白血病…<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/9d/sada_org.gif\">】她叫于子墨，家住河北廊坊，6岁。爸爸是退伍军人，妈妈是特教老师，她爱笑，爱跳舞。这个原本幸福的家庭在1月3日忽然迎来噩耗，小子墨查出粒细胞白血病M5型，短短几天就用去了十几万。如今这个本不富裕的家庭入不敷出。（人民日报）<a href=\"http://t.cn/RZ3QHCD\"><i >°</i>#同城帮帮忙#全城求助，救救小子墨</a>转发，帮帮他们！', '<img src=\"http://ww3.sinaimg.cn/mw690/884f7263jw1eoslxvkbw9j20ck08et9l.jpg\">\n\n                                \n                <img src=\"http://ww3.sinaimg.cn/mw690/884f7263jw1eoslxvnk20j20ck0cuwfs.jpg\">\n\n                                \n                <img src=\"http://ww1.sinaimg.cn/mw690/884f7263jw1eoslxvnetoj20ck0eamy5.jpg\">\n\n                                \n                <img src=\"http://ww4.sinaimg.cn/mw690/884f7263jw1eoslxvs4l1j20ck0gy0v4.jpg\">\n\n                                \n                <img src=\"http://ww2.sinaimg.cn/mw690/884f7263jw1eoslxw5ebyj20ck0h4abu.jpg\">\n\n                                \n                <img src=\"http://ww4.sinaimg.cn/mw690/884f7263jw1eoslxvzrbzj20ck0gxt9p.jpg\">\n\n                                \n                <img src=\"http://ww1.sinaimg.cn/mw690/884f7263jw1eoslxw3j57j20ck0cy75m.jpg\">\n\n                                \n                <img src=\"http://ww1.sinaimg.cn/mw690/884f7263jw1eoslxwcaq5j20ck0gsmyl.jpg\">\n\n                                \n                <img src=\"http://ww4.sinaimg.cn/mw690/884f7263jw1eoslxwawewj20ck0gijte.jpg\">');
INSERT INTO `weibo` VALUES (581, '佳佳wk0Y', '2015-01-31 19:26:00', '转发微博', NULL, 0, '贺卫方', '2015-01-31 13:00:00', '风雨凄凄，鸡鸣喈喈，既见君子。云胡不夷？ 风雨潇潇，鸡鸣胶胶。既见君子，云胡不瘳？ 风雨如晦，鸡鸣不已。既见君子，云胡不喜？', '<img src=\"http://ww2.sinaimg.cn/mw690/48866320gw1eosm6t42huj21kw11xq8q.jpg\"><i  style=\"display:none;\"></i>');
INSERT INTO `weibo` VALUES (582, '佳佳wk0Y', '2015-01-26 13:43:00', '转发微博', NULL, 0, '贺卫方', '2015-01-26 12:58:00', '【有错么】宪政就是要树立宪法权威，限制一切公权力（包括政党权力），保障公民能完整地享有言论出版结社信仰人身财产等权利与自由，就是要通过独立司法使得一切滥用权力的行为得以矫正，就是追求共和政体的真意。惟其如此，国族方有活力，社会更有序，官场更清廉，政府也更有权威。错了么？', '<img src=\"http://ww2.sinaimg.cn/mw690/48866320gw1eomu1soczhj20cs0ehgmu.jpg\"><i  style=\"display:none;\"></i>');
