INSERT INTO `weibo` VALUES (615, '佳佳wk0Y', '2014-10-24 15:48:00', '努力成为后者', NULL, 0, '皓伦王明川', '2014-10-24 14:02:00', '看懂了这段话，你就成熟了：请你晚上吃饭的人很多，给你买早餐的人太少；请你喝酒的人很多，喝醉照顾你的人太少；生病时关心你的人很多，能给你买药带你去看病的太少；嘘寒问暖的很多，能真给你送衣送伞的太少；平时说大话的很多，当有困难帮你的人太少。——不要把脾气留给至亲，而把微笑送给外人。', '<img src=\"http://ww1.sinaimg.cn/mw690/8d05b653tw1elm7lzp25zj20ku0dwgnc.jpg\"><i  style=\"display:none;\"></i>');
