INSERT INTO `weibo` VALUES (622, '佳佳wk0Y', '2016-12-03 23:26:00', '//<a href=\"http://weibo.com/n/Laruence?from=feed&amp;loc=at\">@Laruence</a>: 油水衙门 //<a href=\"http://weibo.com/n/%E9%A5%AD%E7%A8%80?from=feed&amp;loc=at\">@饭稀</a>://<a href=\"http://weibo.com/n/mingsheng1?from=feed&amp;loc=at\">@mingsheng1</a>: 几年前就听说过福彩的黑幕<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/c3/zy_org.gif\"> //<a href=\"http://weibo.com/n/vinW?from=feed&amp;loc=at\">@vinW</a>:转发微博', NULL, 0, '石瘦岩枯', '2016-12-03 10:13:00', '近日，中共民政部长李立国、副部长窦玉沛双双被免职。港媒消息称，二人已被双规；仅在福利彩票方面，二人就涉嫌卷入逾2千亿（人民币，下同）的贪腐大案，李立国包养了11名情妇，花费逾10亿。<br><br>据香港争鸣杂志2016年12月号报导，原中共民政部部长李立国和排名第一的副部长窦玉沛，先后于今年10月23日、2...<a href=\"/3195051264/EkmOx1kmA\">展开全文<i >c</i></a>', '');
