INSERT INTO `weibo` VALUES (627, '佳佳wk0Y', '2016-11-26 02:54:00', '//<a href=\"http://weibo.com/n/%E6%88%98%E4%BA%89%E5%8F%B2%E7%A0%94%E7%A9%B6?from=feed&amp;loc=at\">@战争史研究</a>: 1913-1922年对希腊人种族屠杀；1914-1923年对亚述人种族屠杀；1915年对亚美尼亚人种族灭绝；1934年屠杀色雷斯犹太人1913年土耳其本土部分穆斯林占80.9%，今天占99.8% //李阿訇265:土耳其穆斯林是99.8%的多数，土耳其的非穆斯林不是活得好好的吗？//:那是因为他们还是少数，若是多数呢？', NULL, 0, '顽黠蒙童', '2016-11-26 00:26:00', '直觉元首再现的时间不会太远了，这或许和视频一样令人沮丧。<a href=\"http://weibo.com/n/%E6%9D%8E%E9%98%BF%E8%A8%87265?from=feed&amp;loc=at\">@李阿訇265</a> <a href=\"http://t.cn/Rfp9lpZ\"><i >L</i>秒拍视频</a> .', '<img src=\"http://ww3.sinaimg.cn/mw690/736f0c7ejw1fa4tkq9o5lj20ns0dcjtg.jpg\"><i ></i><a>小窗口</a>');
