INSERT INTO `weibo` VALUES (630, '佳佳wk0Y', '2016-11-20 12:19:00', '好主意', NULL, 0, 'Vista看天下', '2016-11-20 12:15:00', '【土将审议强奸未成年人合法化提案：娶受害人可免责】土耳其正义发展党政府已向议会提出一项法案，即强奸未成年人的罪犯如果迎娶受害者即可免责。土耳其司法部长表示，“将强奸犯送入监狱会使得这些贫苦出身的孩子和家庭沦入极大的经济困难之中。我们想做的是为这一社会问题寻找最合适的解决方案。“”...<a href=\"javascript:void(0);\"><i >¡</i>查看图片</a><a href=\"/1323527941/Eip3jhzR8\">展开全文<i >c</i></a>', '<a>\n                    <img src=\"http://tc.sinaimg.cn/maxwidth.2048/tc.service.weibo.com/image_thepaper_cn/8d644d5b5e2a8153fd46748cec3917ab.jpg\"></a>\n                \n                                            澎湃新闻\n                                                        \n                <em ></em>\n            \n            \n                \n                    <h4 >土耳其议会将审议强奸未成年人合法化提案，娶受害人即可免责</h4>');
INSERT INTO `weibo` VALUES (631, '佳佳wk0Y', '2016-11-20 11:16:00', '//<a href=\"http://weibo.com/n/%E7%A8%8B%E5%BA%8F%E5%91%98%E9%82%B9%E6%AC%A3?from=feed&amp;loc=at\">@程序员邹欣</a>: <img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/5c/yw_org.gif\"><img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/a0/gm_org.gif\"><img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/b6/sb_org.gif\">', NULL, 0, '刘芮东', '2016-11-19 23:47:00', '一个出租车司机说：这几天，我一直在琢磨，开着政府检验合格的车、烧着政府说达标的油、贴着政府发给的环保排放合格绿标，政府却告诉我空气质量差是汽车尾气造成的，我就纳闷儿了，难道是我们踩油门的姿势不对吗？(转)', '<img src=\"http://ww4.sinaimg.cn/orj360/5460e745jw1f9xulsimxxj20p01200xa.jpg\"><i  style=\"display:none;\"></i>');
