INSERT INTO `weibo` VALUES (650, '佳佳wk0Y', '2016-10-16 22:52:00', '//<a href=\"http://weibo.com/n/%E7%8E%8B%E7%97%9E%E7%88%B7?from=feed&amp;loc=at\">@王痞爷</a>: 正是我想说的！', NULL, 0, '丹青书房', '2016-10-15 17:19:00', '看到一段话：结了婚就替单身朋友着急，离过婚就觉得别人的婚姻都是假相，生了孩子就觉得不生孩子都自私，先工作的就觉得读研读博就是浪费生命，自由职业了就认为上班族在出卖灵魂，买了房子就认为砸锅卖铁买房子才是正经事。人，说到底都不觉得自己的选择是对的，才会用拉人下水的形式找认同。', '');
