INSERT INTO `weibo` VALUES (653, '佳佳wk0Y', '2016-10-09 21:39:00', '//<a href=\"http://weibo.com/n/%E8%BF%99%E4%B8%8D%E6%98%AF%E5%8E%86%E5%8F%B2?from=feed&amp;loc=at\">@这不是历史</a>: 哈哈哈哈', NULL, 0, '这不是历史', '2016-10-09 21:01:00', '哈哈哈哈哈！！张老师又来了，各位同学，北京机会多，北京钱多，但是不是你想那样... 全程太搞笑了，视频较长，建议先转再看。。。<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/6a/laugh.gif\"><img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/6a/laugh.gif\">    <a href=\"http://t.cn/RVwYJYd\"><i >L</i>最神奇的视频的秒拍视频</a>', '<img src=\"http://lxqncdn.miaopai.com/stream/Iqe~ewZ4hpEVSBT9qB24Mw___m.jpg\"><i ></i><a>小窗口</a>');
INSERT INTO `weibo` VALUES (654, '佳佳wk0Y', '2016-10-07 09:50:00', '//<a href=\"http://weibo.com/n/%E7%A8%8B%E5%BA%8F%E5%91%98%E9%82%B9%E6%AC%A3?from=feed&amp;loc=at\">@程序员邹欣</a>: //<a href=\"http://weibo.com/n/%E7%9D%A1%E7%9C%BC%E6%83%BA%E5%BF%AA%E7%9A%84%E5%B0%8F%E5%8F%B6%E5%85%88%E6%A3%AE?from=feed&amp;loc=at\">@睡眼惺忪的小叶先森</a>:“炒房，不仅仅是谋财，也是害命”。小叶先森名言，转载注明出处，侵权必究！ //<a href=\"http://weibo.com/n/%E6%98%8E%E9%A3%8E?from=feed&amp;loc=at\">@明风</a>:转发微博', NULL, 0, '美国-Kevin律师', '2016-10-06 12:19:00', '【在美国，为什么房子不能炒？】炒房是投资，天经地义，政府如果是硬性发文不给买卖，那肯定是违宪的。但在美国，大家都知道有两种东西不能炒，房子和粮食，美国政府认为这两样是保障民生的最重要手段，副食品和房子价格暴涨，就会造成社会动荡。那么美国政府凭什么控制房价限制炒作呢？大家都知道，美...<a href=\"/2611641094/EbyQGBUAJ\">展开全文<i >c</i></a>', '<img src=\"http://ww3.sinaimg.cn/orj360/9baa7b06gw1f8ifhoyv03j213g0uajy0.jpg\"><i  style=\"display:none;\"></i>');
