INSERT INTO `weibo` VALUES (728, '佳佳wk0Y', '2016-07-01 08:48:00', '//<a href=\"http://weibo.com/n/%E4%B8%AD%E7%A7%91%E5%A4%A7%E8%83%A1%E4%B8%8D%E5%BD%92?from=feed&amp;loc=at\">@中科大胡不归</a>: 为啥民众声讨不绝于耳？显然，这份修订意见与当面面临的工作的机遇和挑战，与广大民众的期待，有相当的差距。近些年来，民众对民族宗教政策的质疑声不断高涨，事出有因。', NULL, 0, '习五一', '2016-07-01 08:14:00', '【以改革思维修订《城市民族工作条例》】<br> 6月29日国务院法制办公室公布国务院关于修改《城市民族工作条例》的决定(征求意见稿)。（以下简称征求意见稿）非议之声此起彼伏。《城市民族工作条例》制定于1993年。20多年来，随着各民族群众跨城乡跨区域跨行业流动加快，对民族工作和城市工作产生重要影响...<a href=\"/1442246695/DCKfg9reA\">展开全文<i >c</i></a>', '<img src=\"http://ww2.sinaimg.cn/orj360/55f6f027jw1f5e39efnkdj20wt0nbdnn.jpg\"><i  style=\"display:none;\"></i>');
INSERT INTO `weibo` VALUES (729, '佳佳wk0Y', '2016-06-29 23:16:00', '//<a href=\"http://weibo.com/n/%E5%9B%9E%E5%BF%86%E4%B8%93%E7%94%A8%E5%B0%8F%E9%A9%AC%E7%94%B2?from=feed&amp;loc=at\">@回忆专用小马甲</a>: 少说两句吧<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/70/88_org.gif\">//<a href=\"http://weibo.com/n/%E6%88%91%E7%9A%84%E5%89%8D%E4%BB%BB%E6%98%AF%E4%B8%AA%E6%9E%81%E5%93%81?from=feed&amp;loc=at\">@我的前任是个极品</a>:<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/70/88_org.gif\">', NULL, 0, '小野妹子学吐槽', '2016-06-29 22:25:00', '你为了省钱而上网购物，为了睡前安眠而刷微博，为了孝敬父母而离乡求学工作，为了开心快乐而喜欢上一个人。结果呢<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/5c/huanglianwx_org.gif\"><img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/5c/huanglianwx_org.gif\"><img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/5c/huanglianwx_org.gif\">', '');
INSERT INTO `weibo` VALUES (730, '佳佳wk0Y', '2016-06-27 13:37:00', '//<a href=\"http://weibo.com/n/orroz?from=feed&amp;loc=at\">@orroz</a>: 长文体验确实很烂，我捐10升97号的。。。<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/b6/doge_org.gif\">//<a href=\"http://weibo.com/n/Laruence?from=feed&amp;loc=at\">@Laruence</a>: 我捐5升!//<a href=\"http://weibo.com/n/%E5%90%B4%E6%A1%91%E5%95%8A?from=feed&amp;loc=at\">@吴桑啊</a>: //<a href=\"http://weibo.com/n/%E5%88%B0%E5%A4%84%E5%90%83247?from=feed&amp;loc=at\">@到处吃247</a>: 有的直接不看了，有的看完之后再手动取关', NULL, 0, '梁欢', '2016-06-26 23:21:00', '微博最近更新了一个功能，一篇长微博用户只能看一部分，想再往下看，需要点「继续阅读，并关注作者」，这是我见过的最愚蠢的产品决策之一。看一篇文章是一个比较随意的行为，而关注一个人则是关乎筛选信息流的重大决策，逼迫用户为了前者去做后者，简直匪夷所思。用户在这样的场景下只可能感到被冒犯。', '<img src=\"http://ww4.sinaimg.cn/orj360/45357f25jw1f591aukugsj20j404gdfz.jpg\"><i  style=\"display:none;\"></i>');
INSERT INTO `weibo` VALUES (731, '佳佳wk0Y', '2016-06-25 23:24:00', '转发微博', NULL, 0, '视觉机器人', '2016-06-25 22:40:00', '【发明】科幻走进现实——Triton，世界首款人造鱼鳃水下呼吸器。使用渗透膜技术，直接从水中源源不断提取氧气，内置双增压马达和大容量电池，一节电池可以在水底自由呼吸45分钟。操作也很简单，咬在嘴里就可使用。  <a href=\"http://t.cn/R50LTLx\"><i >L</i>秒拍视频</a>', '<img src=\"http://dlqncdn.miaopai.com/stream/U8nhwjGA56YsZjDq6SxOTQ___m.jpg\"><i ></i><a>小窗口</a>');
INSERT INTO `weibo` VALUES (732, '佳佳wk0Y', '2016-06-25 14:36:00', '//<a href=\"http://weibo.com/n/%E8%A7%86%E8%A7%89%E6%9C%BA%E5%99%A8%E4%BA%BA?from=feed&amp;loc=at\">@视觉机器人</a>: 不敢想象，10年后多少人没饭吃了//<a href=\"http://weibo.com/n/%E8%BE%BE%E8%8A%AC%E5%A5%87%E7%9A%84%E6%81%B6%E9%AD%94%E6%B2%A1%E6%9C%89%E7%AC%AC%E5%9B%9B%E5%AD%A3%E4%BA%86?from=feed&amp;loc=at\">@达芬奇的恶魔没有第四季了</a>: 屌丝们颤抖吧！你们就要永远地失业了！', NULL, 0, '视觉机器人', '2016-06-24 19:21:00', '重磅！！今天波士顿动力推出最新SpotMini机器人，是一个更小的版本，重达55磅的全电动无液压的机器人，一次充电可运行约90分钟。 SpotMini是我们有史以来最安静的机器人之一。它有各种传感器，包括深度摄像头，固态陀螺仪（IMU）和本体传感器四肢。这些传感器帮助导航和移动操作。 <a href=\"http://t.cn/R5Wm7st\"><i >L</i>秒拍视频</a>', '<img src=\"http://ww3.sinaimg.cn/mw690/736f0c7ejw1f56jbb2dj0j20bu06kq3h.jpg\"><i ></i><a>小窗口</a>');
