INSERT INTO `weibo` VALUES (747, '佳佳wk0Y', '2016-06-18 14:04:00', '转发微博', NULL, 0, '视觉机器人', '2016-06-18 13:30:00', '93岁日本老奶奶的“手鞠”作品吧！日语叫做“てまり”，就是“手鞠”或者“手毬”。在日本是非常受女孩子欢迎的玩具。在日本的江户时代到明治期间，它只是在新年才能玩儿的一种玩具，但现在已经是不分季节，常年可以玩耍。“手鞠”就是在“蹴鞠”的基础上进行的一种日式改良的作品。', '<img src=\"http://ww4.sinaimg.cn/thumb150/0060jr72jw1f4zbd3n6ucj30gj0fhadj.jpg\">\n                                                <img src=\"http://ww3.sinaimg.cn/thumb150/0060jr72jw1f4zbd4g6kvj30gj0g076x.jpg\">\n                                                <img src=\"http://ww1.sinaimg.cn/thumb150/0060jr72jw1f4zbd50y9cj30gj0g4n03.jpg\">\n                                                <img src=\"http://ww2.sinaimg.cn/thumb150/0060jr72jw1f4zbd5ei38j30gj0fz41n.jpg\">\n                                                <img src=\"http://ww4.sinaimg.cn/thumb150/0060jr72jw1f4zbd67vdtj30gj0g0gp1.jpg\">\n                                                <img src=\"http://ww3.sinaimg.cn/thumb150/0060jr72jw1f4zbd6s2qbj30gj0b2q5l.jpg\">\n                                                <img src=\"http://ww2.sinaimg.cn/thumb150/0060jr72jw1f4zbd7a3d4j30gj0b0dip.jpg\">\n                                                <img src=\"http://ww1.sinaimg.cn/thumb150/0060jr72jw1f4zbd7sqqoj30fe0jg75b.jpg\">\n                                                <img src=\"http://ww3.sinaimg.cn/thumb150/0060jr72jw1f4zbd8j91qj30gj0b2n03.jpg\">');
INSERT INTO `weibo` VALUES (748, '佳佳wk0Y', '2016-06-17 13:45:00', '//<a href=\"http://weibo.com/n/Laruence?from=feed&amp;loc=at\">@Laruence</a>: 哈哈哈哈哈 //<a href=\"http://weibo.com/n/%E8%80%81%E7%A5%9D?from=feed&amp;loc=at\">@老祝</a>:蛤蛤蛤 //<a href=\"http://weibo.com/n/%E6%9D%A5%E5%8E%BB%E4%B9%8B%E9%97%B4?from=feed&amp;loc=at\">@来去之间</a>:转发微博', NULL, 0, '互联网的那点事', '2016-06-17 09:10:00', '【青岛全城出租车集体罢工抵制专车】原本这些出租车司机的想法是，罢工5天，让青岛市民感受下没有出租车看你们怎么活，刷存在感，然后事情的发展完全超出了出租车司机们的预料...哈哈哈哈哈...', '<img src=\"http://ww1.sinaimg.cn/orj360/6106a4f0gw1f4xy2dmaiaj20hs84enpd.jpg\"><i  style=\"display:none;\"></i>                            <i >长图</i>');
