INSERT INTO `weibo` VALUES (837, '佳佳wk0Y', '2016-03-20 11:03:00', '转发微博', NULL, 0, '山东大学', '2016-03-19 22:41:00', '<a href=\"http://huati.weibo.com/k/%E5%B1%B1%E5%A4%A7%E5%BF%83%E8%AF%AD?from=501\">#山大心语#</a>我想让你见识一下什么是真正的勇敢，而不要错误地认为一个人手握枪支就是勇敢 。勇敢是：当你还未开始就已知道自己会输，可你依然要去做，而且无论如何都要把它坚持到底。你很少能赢，但有时也会。（哈珀·李《杀死一只知更鸟》）晚安。', '<img src=\"http://ww1.sinaimg.cn/orj360/701c020bjw1f22jx83xtmj20m80etgmo.jpg\"><i  style=\"display:none;\"></i>');
