INSERT INTO `weibo` VALUES (840, '佳佳wk0Y', '2016-03-13 13:15:00', '//<a href=\"http://weibo.com/n/Laruence?from=feed&amp;loc=at\">@Laruence</a>: 我们有马克思主义啊 //<a href=\"http://weibo.com/n/%E5%B9%B3%E5%87%A1%E7%9A%84%E9%A6%99%E8%8D%89?from=feed&amp;loc=at\">@平凡的香草</a>://<a href=\"http://weibo.com/n/scmroad%E9%85%8D%E7%BD%AE%E7%AE%A1%E7%90%86%E4%B9%8B%E8%B7%AF?from=feed&amp;loc=at\">@scmroad配置管理之路</a>: //<a href=\"http://weibo.com/n/huangyi1979?from=feed&amp;loc=at\">@huangyi1979</a>:Repost', NULL, 0, 'charlesgoo', '2016-03-13 09:32:00', '人家已经基因靶向治疗了，你还在中医的肾不是解剖的肾；人家都自动驾驶了，你还在研究限行收拥堵费；人家芯片一禁运，你家手机龙头企业就停牌；人家的搜索引擎战胜了世界冠军，你家的搜索引擎忙着卖假药。所以贵国到底要拿什么向米帝挑战？房地产？中国梦？北上广深去库存，买下米帝全国？', '');
