INSERT INTO `weibo` VALUES (843, '佳佳wk0Y', '2016-03-09 13:21:00', '//<a href=\"http://weibo.com/n/%E7%A8%8B%E5%BA%8F%E5%91%98%E9%82%B9%E6%AC%A3?from=feed&amp;loc=at\">@程序员邹欣</a>: 终于知道老百姓的苦//<a href=\"http://weibo.com/n/%E9%87%91%E5%B1%B1?from=feed&amp;loc=at\">@金山</a>:→_→//<a href=\"http://weibo.com/n/%E6%9D%A8%E5%B0%8F%E5%A8%B1?from=feed&amp;loc=at\">@杨小娱</a>:知道了，你们不是老百姓。。//<a href=\"http://weibo.com/n/%E4%BA%8E%E6%B6%9B100?from=feed&amp;loc=at\">@于涛100</a>: //<a href=\"http://weibo.com/n/%E5%B0%8F%E5%A4%A9%E5%A4%A9?from=feed&amp;loc=at\">@小天天</a>:哈哈 //<a href=\"http://weibo.com/n/%E5%88%98%E5%BD%AC?from=feed&amp;loc=at\">@刘彬</a>:知道了，你女儿都生孩子了，前半辈子从没去挂过号看过病。。。', NULL, 0, '南都周刊', '2016-03-09 12:28:00', '【原卫生部副部长黄洁夫：外孙到医院看病花了4小时】黄洁夫说，小外孙病了，他看了一下认为“没事”，可女儿觉得还是要去儿童医院。黄洁夫对女儿说，“那你自己去挂号吧。”等挂完号、看完病，花了整整四小时。“到后面，我女儿都哭了，回来说，老百姓看病太难了”。<a href=\"http://t.cn/RGRFBwL\"><i >O</i>原卫生部副部长黄洁夫：外孙到儿童医院挂号看...</a>（新京报）', '<img src=\"http://ww1.sinaimg.cn/orj360/61d7cd94gw1f1qhyttll0j20c8085wex.jpg\"><i  style=\"display:none;\"></i>');
INSERT INTO `weibo` VALUES (844, '佳佳wk0Y', '2016-03-08 00:08:00', '//<a href=\"http://weibo.com/n/Laruence?from=feed&amp;loc=at\">@Laruence</a>: 呵呵，未成年畜生保护法 //<a href=\"http://weibo.com/n/%E5%90%B4%E6%A1%91%E5%95%8A?from=feed&amp;loc=at\">@吴桑啊</a>://<a href=\"http://weibo.com/n/__eternity__?from=feed&amp;loc=at\">@__eternity__</a>://<a href=\"http://weibo.com/n/sofish?from=feed&amp;loc=at\">@sofish</a>: //<a href=\"http://weibo.com/n/%E9%9F%A6%E6%81%A9%E5%8D%91%E9%84%99?from=feed&amp;loc=at\">@韦恩卑鄙</a>://<a href=\"http://weibo.com/n/outsider%E6%98%86%E4%BB%91?from=feed&amp;loc=at\">@outsider昆仑</a>://<a href=\"http://weibo.com/n/%E6%8D%89%E5%88%80%E4%BA%BA?from=feed&amp;loc=at\">@捉刀人</a>: 感谢右边的指正和补充//<a href=\"http://weibo.com/n/%E6%88%98%E4%BA%89%E5%8F%B2%E7%A0%94%E7%A9%B6WHS?from=feed&amp;loc=at\">@战争史研究WHS</a>:今天被人翻出来的2007年旧闻）是这个     <a href=\"http://t.cn/SVOKus\"><i >O</i>网页链接</a>     黑龙江13岁小孩强奸少女并泼汽油焚烧灭口，免于刑事处罚', NULL, 0, '捉刀人', '2016-03-07 15:16:00', '三个年轻人，在美国污辱了一位女同学，被判入狱，爹妈有钱都摆不平；同样三个年轻人，在中国下药轮奸了一位女同学，情节要严重很多倍，至今在外面逍遥。有人问我为什么当美分汉奸走狗卖国贼当得这么开心，我觉得答案已经有了。', '');
INSERT INTO `weibo` VALUES (845, '佳佳wk0Y', '2016-03-07 23:59:00', '//<a href=\"http://weibo.com/n/%E5%9B%9E%E5%BF%86%E4%B8%93%E7%94%A8%E5%B0%8F%E9%A9%AC%E7%94%B2?from=feed&amp;loc=at\">@回忆专用小马甲</a>: 喵星人的种族天赋…<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/34/xiaoku_org.gif\">//<a href=\"http://weibo.com/n/%E4%B8%80%E5%92%AB%E5%A4%95?from=feed&amp;loc=at\">@一咫夕</a>:<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/34/xiaoku_org.gif\">我真的拥有这项技能……然而心好累……真的很容易睡着…… //<a href=\"http://weibo.com/n/%E7%9F%A5%E4%B9%8E%E5%A4%A7%E7%A5%9E?from=feed&amp;loc=at\">@知乎大神</a>:想拥有这种随时随地都能睡着的技能……', NULL, 0, '回忆专用小马甲', '2016-03-07 23:03:00', '猫咪睡姿的小合集，堪称睡觉届的奥斯卡……讲究的是随时、随地、任意姿势……看困了<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/34/xiaoku_org.gif\"><a href=\"http://t.cn/RG8iH28\"><i >L</i>秒拍视频</a>', '<img src=\"http://ww1.sinaimg.cn/mw690/736f0c7ejw1f1op4bya1mj20nq0dcq4o.jpg\"><i ></i><a>小窗口</a>');
