INSERT INTO `weibo` VALUES (847, '佳佳wk0Y', '2016-03-07 21:33:00', '呵呵//<a href=\"http://weibo.com/n/%E7%94%B0_%E6%9C%88?from=feed&amp;loc=at\">@田_月</a>: 呵呵', NULL, 0, '投资界微博', '2016-03-07 11:35:00', '【9天时间里我所亲历的北京抢房潮】作者说：9天时间里，我称经历的这场抢房风暴为浩劫。它偷走了我一直坚持的信念。一 直以来，我相信通过自己的努力是可以让生活变得更好的。这次让我深深体会到无力感。它给我灌输了投机倒把的好处。它让我看到了用房产进行的阶级固化。<a href=\"http://t.cn/RGQRWQ5\"><i >O</i>地产金融</a>', '<img src=\"http://ww2.sinaimg.cn/orj360/69c94e53jw1f1o57xkpimj20dc08udfx.jpg\"><i  style=\"display:none;\"></i>');
