INSERT INTO `weibo` VALUES (860, '佳佳wk0Y', '2016-02-28 14:37:00', '//<a href=\"http://weibo.com/n/%E7%A8%8B%E5%BA%8F%E5%91%98%E9%82%B9%E6%AC%A3?from=feed&amp;loc=at\">@程序员邹欣</a>: //<a href=\"http://weibo.com/n/%E6%AE%86%E7%9F%A5%E9%98%81?from=feed&amp;loc=at\">@殆知阁</a>: //<a href=\"http://weibo.com/n/%E6%88%98%E4%BA%89%E5%8F%B2%E7%A0%94%E7%A9%B6WHS?from=feed&amp;loc=at\">@战争史研究WHS</a>:回复<a href=\"http://weibo.com/n/Panzeryama?from=feed&amp;loc=at\">@Panzeryama</a>:“货物包装”是客气的说法<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/19/heia_org.gif\">   <a href=\"javascript:void(0);\"><i >¡</i>评论配图</a>   //<a href=\"http://weibo.com/n/Panzeryama?from=feed&amp;loc=at\">@Panzeryama</a>:罩袍=货物包装，笑看小清新继续舔沙特王室。', NULL, 0, '战争史研究WHS', '2015-12-12 19:58:00', '图1-图8为各地美丽的穆斯林传统服饰：图1阿富汗；图2阿曼和近东；图3近东；图4伊朗；图5乌兹别克；图6塔吉克、吉尔吉斯；图7维吾尔、回、东干；图8也门、摩洛哥。图9是沙特这些年向全球输出的瓦哈比黑罩袍。<a href=\"http://huati.weibo.com/k/%E5%8F%8D%E9%BB%91%E7%BD%A9%E8%A2%8D%E2%89%A0%E5%8F%8D%E4%BC%8A%E6%96%AF%E5%85%B0%EF%BC%9B%E6%8E%A8%E5%B9%BF%E9%BB%91%E7%BD%A9%E8%A2%8D%3D%E5%8F%8D%E4%BC%8A%E6%96%AF%E5%85%B0?from=501\">#反黑罩袍≠反伊斯兰；推广黑罩袍=反伊斯兰#</a>', '<img src=\"http://ww1.sinaimg.cn/thumb150/a68d6077jw1eyx4gf030wj20j20j2n3v.jpg\">\n                                                <img src=\"http://ww2.sinaimg.cn/thumb150/a68d6077jw1eyx4gh1ucbj20j20j27b6.jpg\">\n                                                <img src=\"http://ww4.sinaimg.cn/thumb150/a68d6077jw1eyx4gj5cthj20j20j27b1.jpg\">\n                                                <img src=\"http://ww3.sinaimg.cn/thumb150/a68d6077jw1eyx4gl1m3nj20j20j2jyc.jpg\">\n                                                <img src=\"http://ww2.sinaimg.cn/thumb150/a68d6077jw1eyx4gn4ez2j20j20j27b0.jpg\">\n                                                <img src=\"http://ww4.sinaimg.cn/thumb150/a68d6077jw1eyx4gpatwrj20j20j2gsz.jpg\">\n                                                <img src=\"http://ww4.sinaimg.cn/thumb150/a68d6077jw1eyx4grbepcj20j20j2n3g.jpg\">\n      