INSERT INTO `weibo` VALUES (887, '佳佳wk0Y', '2016-02-20 15:26:00', '//<a href=\"http://weibo.com/n/%E7%A8%8B%E5%BA%8F%E5%91%98%E9%82%B9%E6%AC%A3?from=feed&amp;loc=at\">@程序员邹欣</a>: //<a href=\"http://weibo.com/n/%E6%9D%A8%E4%BC%AF%E6%BA%86?from=feed&amp;loc=at\">@杨伯溆</a>://<a href=\"http://weibo.com/n/%E4%B8%89%E4%BD%93%E5%A2%9E%E7%BB%B4%E9%83%AD%E6%95%AC%E6%98%8E?from=feed&amp;loc=at\">@三体增维郭敬明</a>:刚看了江的遗书，同样年近四十的他仅有存款十余万//<a href=\"http://weibo.com/n/%E4%B8%80%E4%BA%8C%E4%B8%80%E4%BA%8C5245907149?from=feed&amp;loc=at\">@一二一二5245907149</a>:我也是华师大的老师，刚到华师大就被人事处八零后的管理人员一顿辱骂，不知所措，当时我的眼泪哗就流下了。我年近四十，这是我自懂事以来，第一次流泪。', NULL, 0, '江绪林', '2016-02-19 12:39:00', '在宜家订了一个小衣柜，华师大教师招待所的管理人员却不允许我搬进宿舍。迄今为止，招待所每年都试图驱逐我一次，当然有充足的理由，那就是学校规定。', '');
