INSERT INTO `weibo` VALUES (942, '佳佳wk0Y', '2015-12-25 23:28:00', '//<a href=\"http://weibo.com/n/%E7%A8%8B%E5%BA%8F%E5%91%98%E9%82%B9%E6%AC%A3?from=feed&amp;loc=at\">@程序员邹欣</a>: 浪里个浪浪里个浪 //<a href=\"http://weibo.com/n/%E5%85%AD%E5%85%AD%E5%8C%85%E5%8C%85?from=feed&amp;loc=at\">@六六包包</a>:今天咱先说点嘛？就说耶稣好儿郎。他千里迢迢西天来，不辞辛苦普度忙。左手拉着玛利亚右手牵着羊，带来欢笑与希望还有威尔刚//<a href=\"http://weibo.com/n/%E4%B8%98%E5%B1%B1%E5%BF%97?from=feed&amp;loc=at\">@丘山志</a>: 你这个小伙说滴好，挺好滴个福音要让大家来赏。今晚上这个苹果不吃也罢，这个饺子的传说一定要记端详。', NULL, 0, '苏耷水', '2015-12-24 21:09:00', '关于耶诞节吃饺子，有一个美丽的传说。相传冰清玉洁耶稣的娘，一日里吃了饺子又喝汤，她夫君出门回家买了椰枣的糖，放在这个汤里服下暖洋洋，哪知道这就怀上了孕，黄花闺女生下救世的郎。这就是上帝交子人难想，早生耶稣疗世人的伤。', '');
