INSERT INTO `weibo` VALUES (973, '佳佳wk0Y', '2015-11-26 22:55:00', '//<a href=\"http://weibo.com/n/%E7%A8%8B%E5%BA%8F%E5%91%98%E9%82%B9%E6%AC%A3?from=feed&amp;loc=at\">@程序员邹欣</a>: “只有当我们充分理解人文学科的真正价值所在，并且学着充分发挥人文学科创立者最初赋予其的核心价值，人们才会慢慢发现，原来...\"', NULL, 0, 'Lens杂志', '2015-11-26 21:36:00', '文史哲毕业生找不到工作，这是怎么了？详见Wei信号“Lens杂志”<a href=\"http://t.cn/RUrNa77\"><i >O</i>文史哲毕业生找不到工作，这是怎么了？| Lens...</a>', '<a href=\"http://t.cn/RUrNa77\">                                                                                    <img src=\"http://r3.sinaimg..jpg\"></a>                                                                                            <h4 ><a href=\"http://t.cn/RUrNa77\">文史哲毕业生找不到工作，这是怎么了？| Lens新知</a></h4>                                                                         Karl Moi Okoth，肯尼亚人。 Okoth毕业于Day Star大学心理学系，毕业后他一直在找相关工作，但最终只能在贫民窟开水果店。 Tania Leon，西班牙人。她2006年从圣地亚哥大学心理学系毕业，她想当个心理医生，但毕业后一直是航空公司的乘务员。 Waleed Ahmed el-Sayed，埃及人。2004年，Waleed从Assyiut大学毕业并获得文学学士学位。后来他在开罗的解放广场上贩卖果汁。 Francesca Baldi，意大利人。Baldi是文学和哲学的双料博士，毕业不久她开始当保姆。');
