INSERT INTO `weibo` VALUES (988, '佳佳wk0Y', '2015-11-02 23:08:00', '//<a href=\"http://weibo.com/n/%E6%88%98%E4%BA%89%E5%8F%B2%E7%A0%94%E7%A9%B6WHS?from=feed&amp;loc=at\">@战争史研究WHS</a>: This English good good, you can you say, no can no bibi. //<a href=\"http://weibo.com/n/%E5%B9%B4%E8%BD%BB%E7%9A%84%E6%B2%99%E7%8B%90%E9%9A%86%E7%BE%8E%E5%B0%94?from=feed&amp;loc=at\">@年轻的沙狐隆美尔</a>:右边这英文也是醉了 //<a href=\"http://weibo.com/n/NASA%E4%B8%BB%E7%BC%96?from=feed&amp;loc=at\">@NASA主编</a>:Robert ,Yes,He is NASA Legend.Although Chinese is not very understand, but I think he is a person worthy of admiration!', NULL, 0, '英国那些事儿', '2015-11-01 23:17:00', '今天要说的.. 是一个NASA传奇老爷爷的故事。。当年，他用一种极其酷炫的方式“借”走了一颗NASA的卫星... 又打算在31年后用一种更酷炫的方式“还”回来...... 他是大师级的轨道专家.. 他是Robert...', '<img src=\"http://ww2.sinaimg.cn/thumb150/97f224aagw1exlvisn0fpj20c8d6z1ky.jpg\"><i >长图</i>\n                            \n                                \n                <img src=\"http://ww4.sinaimg.cn/thumb150/97f224aagw1exlvlo5hrwg20b4066hdt.gif\"><i >GIF</i>');
