INSERT INTO `weibo` VALUES (996, '佳佳wk0Y', '2015-09-27 23:26:00', '//<a href=\"http://weibo.com/n/%E8%B4%BE%E5%A4%A7%E6%88%B7?from=feed&amp;loc=at\">@贾大户</a>: 那几个人一贯抹黑的，看名字就知道 //<a href=\"http://weibo.com/n/%E9%9D%9E%E5%B8%B8%E9%98%BF%E6%9D%9C?from=feed&amp;loc=at\">@非常阿杜</a>:二狗子，公知，口水一地//<a href=\"http://weibo.com/n/%E9%83%91%E7%BB%B4?from=feed&amp;loc=at\">@郑维</a>:是的。', NULL, 0, '朱德泉', '2015-09-27 19:38:00', '【公知移花接木太无耻】习总演讲是采纳SDG的首脑大会，属工作会议，只面向各成员国代表，因各国首脑相聚一室，安保要求很高，甚至要求联合国部分职员在家办公；教皇演讲面向所有公众，包括联合国职员等各界人士。注意，图2奥巴马演讲的图片是去年联大一般性辩论画面，公知移花接木黑习总，又被打脸了。', '<img src=\"http://ww4.sinaimg.cn/thumb150/dd855c11jw1ewh8thg0mlj20hs0budhk.jpg\">\n                                                <img src=\"http://ww4.sinaimg.cn/thumb150/dd855c11jw1ewh8thq4m3j20m80e2acp.jpg\">\n                                                <img src=\"http://ww1.sinaimg.cn/thumb150/dd855c11jw1ewh8th5rk8j20hs0vkwk1.jpg\">');
