INSERT INTO `weibo` VALUES (998, '佳佳wk0Y', '2015-09-10 00:10:00', '我姥姥今年快九十了，三十多守寡，三子两女，现在生病，已经有些糊涂了，除了母亲每天白天去照顾，别人都盼着她早走。想把她接回我家，但是已经接不走了。“接走，死了都不能进这个门”，不知道谁说的。人穷志短，多少是非都是因为我没钱', NULL, 0, '逗自己玩呐', '2015-09-09 18:15:00', '有个疼你的好姥姥就转啦吧，不管在世与否！', '<img src=\"http://ww1.sinaimg.cn/orj360/6e232a81jw1evwd96sr3mj209a3uwq77.jpg\"><i  style=\"display:none;\"></i>                            <i >长图</i>');
