INSERT INTO `weibo` VALUES (1023, '佳佳wk0Y', '2015-08-11 13:21:00', '转发微博', NULL, 0, '与欧洲有关的一切', '2015-08-11 11:30:00', '【TED演讲：什么是最好的结婚对象】 她叫Tracy McMillan，母亲是性工作者，父亲大半生在监狱度过，9岁前被超过20个家庭寄养。她曾以为结婚是依靠，三次失败的婚姻过后，她开始了对自我的思考。听离过3次婚的女人讲婚姻观：你希望别人爱你，就先爱自己。<a href=\"http://weibo.com/n/%E9%98%BF%E5%B0%94%E6%B3%95%E5%B0%8F%E5%88%86%E9%98%9F?from=feed&amp;loc=at\">@阿尔法小分队</a> <a href=\"http://t.cn/RLQvbSX\"><i >L</i>美女TED演讲：最好的结婚对象其实是你自己</a><a href=\"javascript:void(0);\"><i >¡</i>查看图片</a>', '<img src=\"http://p4.v.iask.com/337/262/138603197_1.jpg\"><i ></i><a>小窗口</a>');
INSERT INTO `weibo` VALUES (1024, '佳佳wk0Y', '2015-08-10 01:50:00', '//<a href=\"http://weibo.com/n/%E7%9F%B3%E5%B0%8F%E6%9D%B0%E5%BE%AE%E5%8D%9A?from=feed&amp;loc=at\">@石小杰微博</a>: 当地政府干什么？<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/7c/angrya_org.gif\"><img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/7c/angrya_org.gif\">', NULL, 0, '黎桂0', '2015-08-09 21:39:00', '山东省平度市崔家集镇大城村孤寡老人李树荣八十四岁，无低保个人应分的1.92亩土地被原村干部卖掉，卖地的收入被原村干部装入腰包 都快饿死了，一辈子也没安上电灯，七年没有吃过一顿饺子，这事由哪个部门给管一下太可怜了， 政府的清官都哪里去了。 <a href=\"http://weibo.cn/pages/1001018008637028308000000\"><i >2</i>平度·崔家集镇</a><a href=\"http://weibo.com/n/%E5%91%A8%E6%9D%8E%E5%9F%8E?from=feed&amp;loc=at\">@周李城</a>', '<img src=\"http://ww4.sinaimg.cn/thumb150/005TX8njjw1euwovyiti9j318g0p0tfh.jpg\">\n\n                                                    \n                    <img src=\"http://ww2.sinaimg.cn/thumb150/005TX8njjw1euwow8o8pwj318g0p0qaq.jpg\">\n\n                                                    \n                    <img src=\"http://ww4.sinaimg.cn/thumb150/005TX8njjw1euwowekcdjj318g0p0wkk.jpg\">\n\n                                                    \n                    <img src=\"http://ww1.sinaimg.cn/thumb150/005TX8njjw1euwowjzyiaj318g0p0wlx.jpg\">\n\n                                                    \n                    <img src=\"http://ww4.sinaimg.cn/thumb150/005TX8njjw1euwox0fe0wj318g0p0jyi.jpg\">\n\n                                                    \n                    <img src=\"http://ww3.sinaimg.cn/thumb150/005TX8njjw1euwox6pir1j318g0p0wji.jpg\">\n\n                                                    \n                    <img src=\"http://ww2.sinaimg.cn/thumb150/005TX8njjw1euwoxb52ilj31400mido9.jpg\">');
