INSERT INTO `weibo` VALUES (1091, '佳佳wk0Y', '2015-06-18 23:11:00', '//<a href=\"http://weibo.com/n/%E8%B4%BA%E5%8D%AB%E6%96%B9?from=feed&amp;loc=at\">@贺卫方</a>: 【于建嵘好样的】体现了学者的尊严，向你致敬！', NULL, 0, '麻毛雄', '2015-06-18 17:40:00', '【于建嵘被约谈】潘书记：我只听党的话！党叫干啥就干啥。 <a href=\"http://weibo.com/n/%E4%BA%8E%E5%BB%BA%E5%B5%98?from=feed&amp;loc=at\">@于建嵘</a> ：一个没有是非观的领导，一个没有社会关怀的知识分子，一个没有学术创造的研究员，有什么资格经常对我指手画脚？！我告诉你，受够了。从今以后，收起你那一套。<a href=\"http://weibo.com/n/%E4%BB%BB%E5%BF%97%E5%BC%BA?from=feed&amp;loc=at\">@任志强</a> <a href=\"http://weibo.com/n/%E5%BC%A0%E9%B8%A3?from=feed&amp;loc=at\">@张鸣</a> <a href=\"http://weibo.com/n/%E8%B4%BA%E5%8D%AB%E6%96%B9?from=feed&amp;loc=at\">@贺卫方</a> <a href=\"http://t.cn/R2EpwsE\"><i >°</i>于建嵘：被约谈日志</a>', '<a href=\"http://t.cn/R2EpwsE\">                        <img src=\"http://ww4.sinaimg.cn/large/4231a8dbjw1et7tj8mh7qj20v90nhadl.jpg\"></a>                                                                            <h4 ><a href=\"http://t.cn/R2EpwsE\">于建嵘：被约谈日志</a></h4>                                            作者于建嵘系中国社会科学院农村发展研究所教授，社会问题研究中心主任。这些年，经常被莫名其妙地约谈。今天发表一被约谈日志。2015年6月15日下午3时40分。接所办公室秦轲电话，称所书记约明天谈话。告知                                                                发布者：麻毛雄');
