INSERT INTO `weibo` VALUES (1109, '佳佳wk0Y', '2015-05-28 12:48:00', '转发微博', NULL, 0, '中国新闻周刊', '2015-05-28 11:01:00', '【近视患者的福音！“仿生镜片”10秒内可让视力恢复】加拿大一家科技公司研发出了一种高科技仿生镜片。研究人员表示，戴上后只要短短10秒钟，就可以让视力快速恢复，而原先不良的视力不但能够被矫正，还能比1.0的视力好出两倍。预计最快2017年产品将问世。<a href=\"http://t.cn/R2cmkrr\"><i >O</i>加拿大发明“仿生镜片” 10秒内可恢复视力(图)</a>', '<img src=\"http://ww3.sinaimg.cn/orj360/61e6c012jw1esjs9gypaxj20bj05s74k.jpg\"><i  style=\"display:none;\"></i>');
