INSERT INTO `weibo` VALUES (1163, '佳佳wk0Y', '2015-03-23 18:18:00', '父母说那时候天天吃高粱面的窝窝头，特别红，闻到味就够了，但是没办法，必须吃//<a href=\"http://weibo.com/n/%E9%9B%B7%E9%A2%90?from=feed&amp;loc=at\">@雷颐</a>: 转//<a href=\"http://weibo.com/n/sibadakesi2008?from=feed&amp;loc=at\">@sibadakesi2008</a>:我烟台郊区。我村的人吃槐树叶子，脸肿得像猪尿泡；吃花生皮碾成的粉渣，拉不出屎，都用手扣。', NULL, 0, '邓相超', '2015-01-07 10:01:00', '《老农民》播后，遭到极左人士攻击谩骂。经历那个时代的人都知道，该剧没有丑化那个时代，恰是对农民的悲惨程度描写不够。我永远忘不了，59、60、61年每年春天什么样的野菜树叶都吃过，比如白杨树叶子、臭椿树叶子……我们是一天三顿当饭吃啊~~苦啊~~苦不堪言~~我很少想当时的一幕幕，一想便泪流满面~·', '');
