INSERT INTO `weibo` VALUES (1191, '佳佳wk0Y', '2015-02-28 23:09:00', '//<a href=\"http://weibo.com/n/%E5%BC%A0%E6%A0%8B_%E6%9C%BA%E5%99%A8%E5%AD%A6%E4%B9%A0?from=feed&amp;loc=at\">@张栋_机器学习</a>: 只要微博做个频道 <a href=\"http://huati.weibo.com/k/%E4%BA%BA%E4%BA%BA%E6%8A%97%E9%9C%BE?from=501\">#人人抗霾#</a> //<a href=\"http://weibo.com/n/%E5%BC%A0%E6%A0%8B_%E6%9C%BA%E5%99%A8%E5%AD%A6%E4%B9%A0?from=feed&amp;loc=at\">@张栋_机器学习</a>: 人人举报污染源，给污染源施加压力，我想到的一个名字是： 人人抗霾！ //<a href=\"http://weibo.com/n/%E5%AD%99%E8%AF%9A?from=feed&amp;loc=at\">@孙诚</a>:在海外的人做个APP，深扒污染企业背后的老板。以暴制暴 //<a href=\"http://weibo.com/n/%E5%BC%A0%E6%A0%8B_%E6%9C%BA%E5%99%A8%E5%AD%A6%E4%B9%A0?from=feed&amp;loc=at\">@张栋_机器学习</a>:除了 PC 和 手机安全，空气安全方面，互联网公司能做点什么？', NULL, 0, '周鸿祎', '2015-02-28 19:28:00', '今天微博被柴静的雾霾调查所刷屏，她用一年时间进行调查，做了大量的工作。柴静的观点是否正确，不同人可能有不同看法。但令人敬佩的是，她认真地调查了，不仅有自己的看法，还提出了自己的方法。同呼吸，共命运。每个人都像柴静一样行动起来，我觉得APEC蓝是可以永驻的。<a href=\"http://t.cn/Rwlubc0\"><i >L</i>柴静雾霾调查:穹顶之下 同呼吸共命运</a>', '<a href=\"http://t.cn/Rwlubc0\">\n                                                                                    <img src=\"http://r2.ykimg.com/0542040854F49B496A0A48154EBD2CC7\"></a>\n                                                    \n                            \n            \n                \n                    <h4 ><a href=\"http://t.cn/Rwlubc0\">柴静雾霾调查:穹顶之下 同呼吸共命运</a></h4>');
