INSERT INTO `weibo` VALUES (1197, '佳佳wk0Y', '2015-02-24 23:42:00', '转发微博', NULL, 0, '童话镇的邮递员', '2015-02-24 23:14:00', '\"鸡蛋石头在一起，磕磕碰碰伤痕累累，鸡蛋终于受不了离开石头。后来遇到棉花，棉花的拥抱那么温暖。鸡蛋才明白：不是努力坚持和忍耐就能换来温暖，要选择适合的，就会很轻松很幸福。再优秀也得碰上识货的人。再付出也得遇上感恩的人。再真诚也得赶上有心的人。再谦让也得面对珍惜的人\"<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/emimage/ee818c.png\">', '');
