INSERT INTO `weibo` VALUES (1236, '佳佳wk0Y', '2015-01-12 10:58:00', '转发微博', NULL, 0, '林沛满', '2015-01-11 11:24:00', '发表了博文《习大大背后的男人》前天晚上，我看到一位业内前辈转发的新闻：清华获国家自然科学一等奖项目：该项目提出了“透明计算”和网络超级操作系统的新网络计算模式，打破了国际同行认为统治了计算机体系结构6<a href=\"http://t.cn/RZ6HgqZ\"><i >°</i>习大大背后的男人</a><a href=\"javascript:void(0);\"><i >¡</i>查看图片</a>', '<a href=\"http://t.cn/RZ6HgqZ\">                        <img src=\"http://s11.sinaimg.cn/mw690/0023q7uRgy6P5KIOkZ44a&amp;amp;690\"></a>                                                                            <h4 ><a href=\"http://t.cn/RZ6HgqZ\">习大大背后的男人</a></h4>                                            前天晚上，我看到一位业内前辈转发的新闻： 清华获国家自然科学一等奖项目：该项目提出了“透明计算”和网络超级操作系统的新网络计算模式，打破了国际同行认为统治了计算机体系结构60年以上的冯&amp;bull;诺依                                                                发布者：林沛满');
INSERT INTO `weibo` VALUES (1237, '佳佳wk0Y', '2015-01-12 10:06:00', '转发微博', NULL, 0, '回忆专用小马甲', '2015-01-12 01:24:00', '妞妞睡着的地方，周围两米内，定能找到端午。妞妞安静时在屋里踱步，端午就在后面跟着。妞妞兴奋起来满屋子疯跑玩球，端午就跳到高处看着。不管妞妞吃啥，端午都把肥脸横过去，啃得动的跟着啃，啃不动就捡点渣。端午一点不关心外面的世界，不爱呆在门口，但遛妞妞回来时，开门得小心，它会蹲在门边等。', '<img src=\"http://ww1.sinaimg.cn/orj360/bfc243a3jw1eo63b3qi4yj20vv0vvthr.jpg\"><i  style=\"display:none;\"></i>');
