INSERT INTO `weibo` VALUES (1239, '佳佳wk0Y', '2014-11-08 21:25:00', '转发微博', NULL, 0, '公安部打四黑除四害', '2014-11-08 10:10:00', '【歌手阿宝见义勇为不声张 徒手帮女民警制服小偷<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/d0/z2_org.gif\">】近日，北京卫视《法制进行时》节目曝光了一组去年发生的反扒案，歌手阿宝意外出现在荧幕中。原来，他见义勇为帮助女民警制服了一名扒手，却一直深藏功与名，直到这名女民警对媒体讲述了这段故事。 <a href=\"http://t.cn/R7EvPAy\"><i >L</i>警花勇者无畏 巾帼不让须眉</a> 这样的精神，该点赞！<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/d0/z2_org.gif\">', '<img src=\"http://ww1.sinaimg.cn/thumb150/8aca58f7jw1em3ctmgm36j20fa0b4gmb.jpg\">\n                                                <img src=\"http://ww1.sinaimg.cn/thumb150/8aca58f7jw1em3cu32wwjj20fa0b7js9.jpg\">');
