INSERT INTO `weibo` VALUES (1241, '佳佳wk0Y', '2014-10-31 17:38:00', '转发微博', NULL, 0, '人民日报', '2014-10-31 11:15:00', '【反贪局证实：能源局煤炭司副<a href=\"http://huati.weibo.com/k/%E5%8F%B8%E9%95%BF%E5%AE%B6%E6%90%9C%E5%87%BA2%E4%BA%BF%E7%8E%B0%E9%87%91?from=501\">#司长家搜出2亿现金#</a>】人民日报记者彭波消息，最高检今天召开的发布会上，反贪污贿赂总局局长徐进辉证实：国家能源局煤炭司副司长魏鹏远家中搜查发现现金折合人民币2亿余元，成建国以来检察机关一次起获赃款现金数额最大的案件。此前有报道称点钞的时候点钞机都烧坏4台。', '<img src=\"http://ww3.sinaimg.cn/orj360/a716fd45gw1elu64y279uj20a409ymy2.jpg\"><i  style=\"display:none;\"></i>');
